8	00	\N	1938	1938 sommer	Hemne?	20	Innsendt	Dette her skjedde i 1938 om sommeren. Jeg ble med noen kjente til Hemne for å selge en liten fiskeskøyte. Det er ca. 12 mil fra Trondheim. Det var varmt og deilig vær husker jeg. Og jeg kan aldri glemme det jeg så der. Så ble det kveld, jeg gikk opp for å legge meg, men jeg våknet for det var grusomt varmt. Og det ble vell mye av varme. Jeg sto opp og listet meg ned. Det var deilig og befriende å komme ut i frisk luft her. Jeg gikk imot en sti litt lengre opp, og satte meg ned for å nyte den herlige utsikten her. Så plutselig hørte jeg en hvinende lyd, intens av styrke. Så avtok lyden. Dette gjentok seg flere ganger. Men plutselig med et trylleslag ble hele området der opplyst der jeg satt. Men så ble det stille igjen. Så begynte det med den lyden på ny. Så økte lyden etterhvert, det var grusomt for ørene, enda jeg stakk begge fingrene i ørene for å døyve smerten i hodet. 20 meter lengre opp i et flott terreng så jeg en langsom rar tingest komme opp. Fargen var blålig samt et rødskjær over det hele. Rundt den var det små hull rundt undersiden som det blåste ut blåhvit eksos ut av. Lukten var grusom, brent nafta og gummi minnet den meg om. Det sved i øynene og halsen. Så jeg nå hele dens fasong der meget tydelig. Det steg lydløst opp men sank ned på ny. Det er vanskelig å si hvor stort det var  omkrets. Men jeg antar diameter var 20-25 meter i omkrets, høyden var 2-3 meter. Da jeg lå cirka 20 meter lenger ned bak noen busker og kratt. Jeg torde ikke røre meg der jeg lå. Satt i transe over det jeg så. Det jeg nå så hadde ingen ting med våre fly å gjøre. Det jeg så var et fremmed vesen, for jeg hadde på følelsen at jeg ble iakttatt av den tingesten der oppe. Jeg så ingen komme ut av det, for det lå dypt nede i en ås-senkning der oppe. Så steg det opp på ny med hvinende lyd. Det steg rett opp, og tok en runde og det lyste opp rundt stedet med den intense eksos-greiene. Det gikk da helt lydløst da, rare greier tenkte jeg. Så forsvant det i nordlig retning, og borte ble det. Det var ikke kulelyn eller noe slikt, eller værballong. Og jeg brukte øynene godt, jeg så ikke syner på grunn av redsel. Nei, det var en ting av samme slaget jeg så i 1948 (Se neste rapport) Jeg kom meg ned fra stedet. Jeg tør ikke gå der oppe hvor det lå. Jeg sa ingen ting om dette til noen. Det var min hemmelighet til nå.(Se tegning)	\N	\N	\N	false	true	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	true	false	\N	false	false	false	false	false	false	false	false	true	Blålig	false	false	true	false	false	false	false	true	false	false	false	\N	false	true	false	\N	false	false	false	false	true	false	\N	true	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	true	false	false	false	false	false	\N	true	false	false	Økende og synk.	false	false	false	false	false	true	20-25 m diameter	\N	\N	\N	3	3	false	false	false	false	false	false	false	false	false	true	false	false	false	false	false	false	false	false	Vet ikke	false	false	true	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	1	1	1	\N	20	false	false	Fløy fort avgårde i nordlig retning	\N	0	1	true	false	false	false	false	false	false	false	false	false	\N	\N	false	\N	3	\N	false	false	\N	4	\N	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	\N	3	\N	Ikke oppe	7	\N	8	\N	4	\N	2	\N	\N	false	\N	false	1	\N	\N	\N	1	\N	\N
9	00	\N	1948	1948-01	\N	20	Innsendt	Jeg hadde kjøpt meg en tysk båt som gjorde en bra fart. En dag tok jeg meg en tur med den sammen med min schæferhund. På hjemturen merket jeg at hunden ble så rar. Den gjemte seg under føttene mine, den la potene sine over ørene som for å dempe lyder. Så jeg så meg rundt, det var ingenting å se. Men så kikket jeg opp mot skyene. Der kom det i en vrimlende fart ned imot sjøen. Som om det kræsj-landet på sjøen og fløy i lav høyde over vannflaten imot oss. Så stoppet det helt og sto som en påle i lufta, som det hang i en usynlig vaier. Det var da cirka 30-35 m foran oss. Og jeg snudde kursen om ifra det. Men det hang som en igle på oss, og ingen andre så jeg i nærheten som kunne ha vært vitne. Så kom det rett over oss. Motoren i min båt stoppet momentant. Jeg brukte starteren men fikk ikke startet den. så for denne tingesten avsted som en kule bare to meter over havflaten, så endret det kurs og forsvant, som et lyn fra klar himmel dit den kom ifra. Dette var litt av en påkjenning. Jeg peilet tanken, det var nok bensin. Så prøvde jeg starteren på ny, den startet med en gang. Og en ting til, jeg fikk atter denne fæle lukten av brent nafta og gummi. Min hund måtte avlives da den ble helt rar etter denne hendelsen. (Se skisse)	\N	\N	\N	false	false	false	false	false	false	true	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	true	false	\N	false	false	false	false	false	false	false	true	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	true	\N	false	false	false	false	true	false	\N	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	true	false	\N	false	false	true	\N	false	false	false	false	true	false	\N	\N	3	\N	3	3	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	Vet ikke	false	false	true	false	\N	false	false	false	false	false	false	false	fals