10	15	01	1941	15011941-01	Tronstad, Innhavet	9	LNS.	Observasjonen skjedde mens vi arbeidet ute på jordet med nybrottsarbeid. Det var om ettermiddagen ca. kl 16 den 15. juni 1941. Sikten var god, med høye skyer, mens vi arbeidet der på jordet ble vi var motorstøy og flydur. En konvoi på flere skip kom inn på fjorden ved Bogøy. Skipene var fulgt av armerte trålere (vaktbåter). Et mindre fly kretset over konvoien hele tiden. Skipene var godt synlige i det de passerte Røtnes (I Steigen) med kurs for Økssundet. Plutselig dukket den "ukjente gjenstanden" opp på vesthimmelen (rett i vest). Den var høyt over fjellene og flyet. Der sto den stille et øyeblikk for deretter å  flytte seg mot nord hvor den stoppet over Lundøy. Her sto den stille en liten stund. Far min som hadde vært til sjøs under 1. verdenskrig sa at -"det må være en sperreballong". Men så flyttet gjenstanden på seg og dukket opp i sør, over Steinslandsfjellene (Steigen fastland) Flyttingen skjedde så fort at vi greide ikke å registrere den. Gjenstanden steg litt sakte opp i den retning den forsvant og dermed var den vekk. Far min sa da at en sperreballong ikke kunne oppføre seg slik. Gjenstanden sto nu stille en lang stund for igjen å foreta samme manøver som over Lundøya. Nå dukket den opp i vest og sto da atter stille. Flyttingen greide vi ikke å se. Etter en stund tok den en oppadstigende bane og forsvant mot syd. Vi så bevegelsen til å begynne med men så var den borte på et blunk. Vi hadde selvsagt ikke hørt om flygende gjenstander av denne kategori den gang. Imidlertid har jeg aldri glemt episoden og jeg har i ettertid satt den i forbindelse med tyskernes forestående angrep på Russland som skjedde 20. juni 1941. Observasjonen varte ca. 15 min. mens konvoien passerte Røtnes på tur nordover. (Se skisse og vedlaggt kart)	\N	\N	\N	false	false	false	false	true	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	f