11	00	7	1942	00071942-01	Forsanvatnet	9	L.N.S.	Merkelig gjenstand i Forsanvatnet.\r\nSommeren 1942 i månedsskiftet juni/juli var jeg sammen med min far på tur til Forsanvatnet hvor vi løypte never til tekke på et naust far skulle bygge. Forsanvatnet ligger ensomt til med lite ferdsel. Da vi kom opp på fjellryggen og så vatnet innover la vi merke til en stor mørk ting midt i vatnet. Den var avlang og rund så vi mente dette måtte være et stort skjær blankskurt av isen. Min far var ikke særlig kjent i området. Vi lå et par døgn oppe i dalen, derfra kunne vi ikke se vatnet. Men da vi gikk heim lå denne tingen på samme plass. Størrelsen kunne sammenliknes med en mindre Ubåt men uten tårn. Nede i Forsan spurte vi eieren av området om det var et skjær i vatnet, det var det ikke sa han og syntes det vi hadde sett var svært merkelig. Meg bekjent ble ikke saken undersøkt. Det kunne jo vært et fly eller lign. som var falt ned. Men vi så intet haleror. Dessuten kunne vel ikke et fly flyte i lengere tid. Det hele er en gåte.(Se vedlagt kart)	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	true	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	true	false	\N	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	\N	1	\N	2	2	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	Annet	false	false	false	true	Ikke	false	false	false	false	false	false	false	false	false	false	false	false	false	false	2	2	2	\N	\N	false	false	\N	Nei	2	1	true	false	false	false	false	false	false	false	false	false	\N	\N	false	\N	2	\N	false	false	\N	4	\N	false	false	false	false	false	false	false	false	false	