12	00	\N	1942	1942-Sommer-01	Marøy	6	G. Bertelsen	Min kusine og jeg lå i hagen og solet oss. Vi pratet om det fantastiske været, helt stille og uten en sky. Solen var varm og sto som vanlig kl.11 en sommerdag. Så så vi plutselig en blank ting liksom stige opp av bakken sydøst for oss, ca. 300 meter borte. Veien skråner nedover fra dette punkt mot syd ellers er det flatt landskap til en haug rett bak vårt hus hjemme. Vi satte oss opp og ropte til de andre tre som stod utenfor hagegjerdet. To menn og en dame. Gjenstanden så ut som en sølvtallerken og dreiet rundt seg selv, men ikke fortere enn at vi så bevegelsen. Den steg langsomt til den var over oss, da så den ut til å dale og de tre grå dottene den hadde etter seg falt ned ca 100 m. nord for vårt hus. Gjenstanden forsvant, vet ikke hvor. De to mennene løp for å hente nedfallet og kom igjen med tre høysåter. Det var ellers intet merkelig ved disse. Naboen i syd sa det var blitt borte noen såter fra ham, uten at han visste om dette.	\N	\N	\N	false	true	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	true	false	\N	false	false	false	false	false	false	true	false	false	Sølvblank	true	false	false	false	false	false	false	false	false	false	false	av høy	false	true	false	\N	false	false	false	false	false	true	Sterkt	true	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	true	false	false	\N	false	true	false	\N	false	false	false	false	false	true	10 m i diameter	\N	1	10	3	3	false	false	false	true	false	false	false	false	false	false	false	false	false	false	false	false	false	false	Fra høyre mot venstre	false	true	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	3	1	3	\N	100 m.	false	false	Vet ikke plutselig vekk	\N	0	1	true	false	false	false	false	false	false	false	false	false	\N	\N	false	\N	3	\N	false	false	\N	1	\N	false	false	false	true	false	false	false	fal