13	29	12	1942	29121942-01	Sundsbarm	18	Innsendt	Det var julen 1942 (muligens 43) 29 eller 30 des. jeg (24) år- gikk på ski på veien (hestekjørevei) opp til Sundsbarmvannet ca. kl. 18.00. Det var delvis overskyet, opphold, kuldegrader, mue snø, ikke vind, ikke måneskinn og dengang ingen elektriske ledninger der.\r\nDa jeg befant meg rett ovenfor elveoset ( i dag er der en 15 m høy demning) ble plutselig hele landskapet over vannet opplyst. jeg kunne konstatere at lyskilden kom fra venstre bak åsen - dette på grunn av skyggene fra åsen og trærne. Objektet kom til syne over fjellet i bakgrunnen - mot himmelen-, stor som fullmånen (slik vi ser den), hadde retning nord - og nedover. Objektet hadde helt klare konturer - akkurat som vi ser månen mot en klar himmel, lysstyrken var muligens litt sterkere enn fullmånen, det var ingen lyd å høre. Objektet gikk inn bak en tåkedott (antagelig tåkedis fra elveoset) men kom til syne igjen hvoretter den forsvant bak åsen til høyre, objektet var da kommet lavere slik at bakgrunnen da var fjellsiden på vestsiden av vannet. Jeg så lyset og skyggene av de tre trærne ved elveoset etter at objektet var blitt borte bak åssiden. Hastigheten ppå objektet var omlag som flyhastigheten på den tid. jeg så objektet sannsynligvis i 2-3-sek. Det var tydelig at objektet fulgte vannet - så og si midtfjords.\r\nAt dette virkelig var et fysisk objekt er det hos meg ingen tvil om, og dette kan forklares med skyggen av åsen og spesielt skyggene av de tre trærne ved elveoset som dreide etter objektets - lyskildens hastighet, synlige både før og etter at objektet passerte feltet mellom åsene. \r\nObjektet hadde retning nord og nedover og etter retningen skulle objektet ha "landet" ved vannets nordlige ende - ved Langlim. Jeg gikk etterpå ut på isen, men kunne da ikke se verken lys eller andre ting.\r\nJeg forlot stedet der oppe dagen etter slik at jeg ikke fikk snakke med noen andre om fenomenet. (Se vedlagt skisse og kart)	\N	\N	\N	false	false	false	fals