14	00	\N	\N	1940-45	Gjeien gård, Andebu?	24	Innsendt	(Under fellesøvelsen mellom Andebu og Teies skolekorps ble følgende UFO opplevelse fortalt meg:\r\nFru Edvardsen som for tiden er sekretær i Andebus musikk-korps og bosatt i Kodal fortalte hva hun og en venninne hadde opplevd under krigen da de selv var ca. 12 år. Det var sommer og sent på etermiddagen, men årstallet husker hun ikke.)\r\nDe kom syklende langs veien ved Gjeien og så plutselig fikk de se en 3-4 lysende gjenstander i nordøstre retning mot uthusene til Horntvet. Gjenstandene var like store som låven på Horntvet, hadde glofarge og skiftet stadig plass og beveget seg nesten som insekter; ned ved bakken. Det hele gjorde et mektig inntrykk på jentene og det står selv i dag klart fram i hukommelsen.\r\nJentene skyndte seg hjem for å fortelle og få foreldrene til å komme og se hendelsen, men alt var forsvunnet da de kom tilbake.\r\nSelv om gjenstanden var i en avstand på ca. 3-400 m. på jordet mellom jentene og uthuset så hadde de tilsynelatende ingen konturer men de virket meget konkrete. Den nærmeste beskrivelse av fargen var som en glødende glo selv om det hele var i fullt dagslys. Bror til den andre observatør ble senere fru Edvardsens mann.\r\nPS. Gården Gjeien var en slags treningsanstalt for Hirden under krigen. Den hadde tilhørt en jøde og hans familie som alle ble henrettet i gasskammeret bortsett fra en sønn som overlevde. (Se vedlagt kart)	\N	\N	\N	false	false	false	false	true	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	true	false	\N	false	false	false	false	false	false	false	false	true	Glofarget	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	true	\N	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	true	false	\N	false	false	true	\N	false	false	false	false	false	true	Se brødtekst	\N	2	\N	3	3	false	false	fa