15	00	4	1944	00041944-01	Bislet	11	OG.Røed	Dette har bare hendt meg en gang. Det var på Bislett Stadion Mars-April i 1944. Solen skinte, himmelen var blå. Jeg gikk på skøyter på indre bane og var på vei mot søndre port, da en rund kule som sølv på størrelse med en tennisball kom som skutt ut av en kanon. Jeg fulgte den hele veien, den ble nesten borte i tåkedisen og mye mindre. Så ble den tydeligere og forsvant over takene ved nordre port. Det hele tok Cirka 1 minutt.\r\nCa. 20 år senere leste jeg i et ukeblad at en amerikaner borti Midtvesten hadde sett en rund kule som skinte som sølv.\r\nMen det mest interessante er det som hendte over Sibir i 1908. Eksplosjonen ble registrert like sterk som en vannstoffbombe og et belte med sølvskyer la seg over Nord-Europa.\r\nHvis det er noen som bygger runde kuler som skinner som sølv eller aluminium, magnesium, nikkel som beveger seg i motsatt retning av det galaksen gjør blir ikke avstanden stor. Men problemet blir å komme ned uten å brenne opp. Jeg har mange ganger tenkt på hvor stor den hadde blitt hvis den hadde kommet ned på Bislet. Det er vanskelig å si. Kanskje de klarer det engang i fremtiden.	\N	\N	\N	false	true	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	true	false	false	\N	true	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	true	\N	false	false	false	false	false	false	\N	true	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	true	false	false	\N	false	true	false	\N	false	false	false	false	false	true	Tennisball	\N	1	\N	2	2	false	false	false	false	true	false	false	false	false	true	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	true	true	false	false	false	false	false	false	false	false	2	1	3	\N	\N	false	false	Over nordre port, ut av synsfelt.	Bak tåke/skyer	1	1	t