18	00	03	1947	1947-Påske-01	Nestun	6	Innsendt	Vi hadde vært ute og solt oss og skulle inn å høre barnetimen, klokken var 17.55. Og gikk ut på kjøkkenet for å vaske opp. Da det begynte noen fryktelige ulyder i radioen, og småpikene ropte på meg, samtidig som jeg var på vei inn. Radioen sto ved vinduet og jeg kastet uvilkårlig øynene opp i luften, og der så jeg noe som måtte være årsaken til forstyrrelsen. Vi glemte hele barnetimen, og tenkte bare på at dette måtte naboene få ta del i. Vi sprang da ut og fikk både voksne og barn med. Så vi var 10 stk. som fulgte det hele. Skal nå prøve å fortelle hva vi så, for det glemmer jeg ikke så lett for jeg har fra jeg var liten trodd at det må bo andre individer i dette store universet. Det som sto på himmelen ikke så langt borte, var noen rare gjenstander i formasjon (Se rapport). De sto ikke rolig, og jeg kunne ikke si med sikkerhet hva fasong  de hadde, for der gjorde jeg en feil, sprang for fort ut. Vi var vel ute etter ca 1-2 min. og da fant vi dem ikke med det samme, men så ropte naboen, at der er dem. De var så langt avgårde, stadig i formasjon. Det så ut for oss at den ene førte an, så kom de to og alle de andre etter. Fra avisene leste vi om at de hadde sett en lysende gjenstand på samme tid. For mitt øye så det ut som om gjenstandene var omgitt av en form for røk eller damp, da de sto stille på himmelen, men ett er sikkert, og det er at de brøt radiobølgene. Det hørtes som om de skar kraftig forkjært på tykt glass. Tenkte det ville være av interesse for Dem å få høre dette så kan De gjøre Dem opp en mening om hva dette kunne være. Jeg tror ikke der har vært så mange på en gang, verken før eller siden, som er oppdaget av oss her nede.	\N	\N	\N	true	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	true	false	false	false	\N	false	false	false	false	false	false	false	true	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	true	\