24	00	09	1949	00091949-01	Fonåsfjellet	5	Innsendt	Det er en mørk og stjerneklar kveld uten lyd eller vind som vi sitter utenfor fiskehytta. Plutselig fikk vi se en sterk kule på himmelen som kom fra sydøstlig kant. Den hadde stor fart og nærmet seg en høy ås som ligger rett mot hytta hvor vi sitter. Denne åsen hører forøvrig til Undsetgrenda som lå under vårt jaktfelt. Denne lysende kula stod stille over den nevnte ås i kanskje et minutt hvorefter den gikk rett ned og stoppet midt på åsen. Det ble så lyst på den mørke åsen at vi kunne se grantrærne tydelig i det sterke lyset. Kula var sirkelrund og skinte med klart hvitt lys. Efterat den hadde stått stille på åsen i et par minutter gikk den opp i rett vinkel og forsvant sydøstover hvorfra den var kommet. Dette var verken kulelyn eller meteor og slettes ikke fly. Jeg har laget en skisse som viser banen denne UFOen hadde, og som vi ikke i alle disse år har kunnet få noen forklaring på. Det er ikke tvil hos meg at det foregår ting ute iverdensrommet, som vi hittil ikke harnoen forklaring på, men en dag skjer det. (Se tegning og kart)	\N	\N	\N	false	true	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	true	false	false	false	\N	false	false	false	false	false	false	false	true	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	true	\N	false	false	false	false	false	true	Veldig sterkt	true	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	true	false	\N	false	false	true	\N	false	false	false	false	true	false	\N	\N	\N	\N	3	3	false	false	false	true	false	false	false	false	false	false	false	false	true	false	false	false	false	false	Vet ikke	false	false	true	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	1	1	1	\N	\N	false	false	Snudde og dro tilbake samme veien den kom.	Foran en ås.	1	1	true	false	false	false	false	false	false	false	