26	00	12	1950	00121950-01	Røverdalen	26	O.G.Røed	Det var like før jul i 1950 eller 1951. Jeg måtte gå ca. 300 meter for å få bussen til skulen, og på veien ble luen blåst av hodet mitt selv om det var vindstille og det vart opplyst rundt meg. Jeg titter opp og fekk se noe stort over hodet på meg som likner på et luftskip ca. 8 meter langt med en stor luke foran (gul), og flere små luker på siden, det kom flere men den siste var ca. 4 meter lang. Det var i  alt 6 stykker, men alle gjekk samme bane. Jeg kommer fra Bøverdalen og alle kom ned fra Galdhøpiggen og ned i dalen og satte kursen mot Galdhøpiggen.\r\nJeg fortalte dette då jeg kom på skulen, men læreren ville ikke tru på meg. Jeg nevnte dette som hendte meg til mine kolleger etter at jeg flyttet til Oslo i børjan av 1960, det var en kollega som var veldig interessert og han lurte på om jeg kunne komme på et ufo-møte. Ledere for dette var en sivilingeniør eller overingeniør, han spurte meg om jeg kunne huske omstrømmen var borte då jeg kom på skulen, jeg mente at strømmen var borte då jeg kom på skulen. Han sendte et brev til kraftselskapet der oppe i Gudbrandsdalen, og han kunne fortelle meg senere at han hadde fått brev tilbake og dei kunne fortelle at strømmen var borte en tid men dei kunne ikke gi noen forklaring på hvorfor strømmen var borte.\r\nJeg mener at avstanden mellom meg og det jeg så var et sted mellom 30 og 50 meter over hodet mitt.\r\n(Se tegning)	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	true	false	false	false	\N	true	false	false	false	\N	false	false	false	false	false	true	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	true	false	\N	false	true	false	false	false	false	\N	true	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	true	false	false	\N	false	true	false	\N	false	false	false	false	false	false	\N	\N	\N	8-4 m	2	2	false	false	false	fa