28	00	07	1952	00071952-01	Funnemark	18	\N	Dette hendte da jeg var 19 år og min søster 17 år, midt på dagen i stekende sol. På den tid vendte vi høyet med rive og gikk etter hverandre i samme retning som slåmaskina hadde slått graset. Min søster gikk ca. 20 meter før meg. Straks etter vi hadde snudd opp mot åsen og var på vei nedover mot dalen hørte jeg en sterk summelyd bak meg. Jeg ropte da til min søster at nå måtte vi raske på for å komme unna en kjempesverm med bier. Jeg kikket da bak meg over skulderen og vendte på så raskt jeg kunne. Bier så jeg ikke, men da summelyden var like sterk så jeg opp, og der var en sigarformet blankpolert metallgjenstand ca. 20-25 meter over hodet på meg.\r\nJeg ropte fram til søstera mi at hun måtte se opp.\r\nFartøyet beveget seg nå fremover i sakte fart over jordet mot en liten kolle med noen trær på. Og borte var den mellom tretoppene. Jeg må også nevne et par ting til med fartøyet utenom bisvermlyden. Det virket som om lyden kam fra 8 tegl-farget gulrøde tallerkener (ca. 30 cm. i diameter) som stod i ring rundt ytterkantene i "rakettens" bakstykke. Men det som var mest framtredende var det røde tegnet som sto på den blålige metalliske "rakett"-kroppen. Dette tegnet som dekte nær halvparten av undersida var forma som en merkelig H uten å være en H. (Se tegning). Jeg tegnet dette ned samme dag som jeg så fartøyet men under en to-tre flyttinger så har jeg måttet forlagt tegningen slik at det jeg gjengir her ikke trenger å være 100 % riktig når det gjelder hakeretningene. Grunnen til at vi ikke rapporterte dette synet den gangen i 1952 til aviser o.l., var at vår far var redd at dette var et nytt hemmelig våpen som Amerikanerne hadde. De har da også senere fått noe liknende som går langs bakken. Jeg tenker da på krysserrakettene. men jeg selv har i alle år ment at dette var en ufo. Det var da heller ingen vanlig rakett da den manglet avgass, men jeg syntes den varmet noe fra bakstussen (en form for stråling).\r\n(Se kart og Hjemmet