30	00	\N	1953	1953-Høst	Nøtterøy	24	\N	De kommer kjørende nordover langs veien ca. 2-300 meter fra Oserød gård, da Foss får se en lysende gjenstand komme fra stor høyde i nordlig retning og i stor fart dale ned mot et større jorde på deres vestre side. Været var klart og det var blitt mørkt. Gjenstanden var som to dype tallerkener lagt mot hverandre og den hadde et grønt skinnende lys som på en måte strålte ut av den. Størrelsen er vanskelig å bedømme men den kunne godt ha vært større enn en bil og ikke gjennomsiktig. Foss syntes at gjenstanden kom temmelig nærme, så han gikk ut som for han sa "ordne litt på radiatoren" men som selvsagt var for å bekrefte at han ikke så syner. Han gikk så inn i bilen igjen og N.N. spør hvorfor de stopper der. Foss svarer: "Jeg måtte ordne litt på radiatorgardina, det er jo så kaldt ute." "Ja, du ser ikke det samme som jeg ser nede på der." svarte N.N. og pekte i retning av objektet. De hadde inntil da ikke gitt til kjenne seg imellom hva de begge hadde sett, men var nå skjønt enige om at det måtte være en av "de flygende tallerkene" som det hadde vært så meget snakk om den gangen. Objektet som ikke helt hadde berørt bakken begynte nå å flytte seg i nordvestlig retning, mot et høydedrag ved navnet Vardås. Foss og N.N. fortsatte turen videre og de merket seg at gjenstanden stadig steg med kurs for Tønsberg. De passerte Oserød gård og bebyggelsen på Roppestad og gjenstanden var da langt ut til venstre inntil de nådde Bergan, da den igjen kom i full fart mot dem og over dem, som om den ville si farvel og så utover Oslofjorden.\r\n\r\nFoss kunne fortelle at det var ingen uhyggesfølelse forbundet med hendelsen og ingen lyd kom fra den. N.N. hadde uttrykt ønske at han godt kunne tenkt seg en tur opp med den tingsten. Med den overlegne teknikk de her ble demonstrert ville de ikke hatt store sjansen hvis den hadde vært ondsinnet.\r\n\r\nFoss har verken før eller siden hatt noen spesiell interesse for ufo saken. De hadde diskutert frem og tilbake om de skulle gå til politiet eller til avisa med saken, men lot de være p.g.a. eventuelle konsekvenser. Det var jo ikke så stor åpenhet om disse tingene dengang som nå. I følge fru Foss så ble det nevnt i lokalavisen at ting var sett på himmelen på den tid.	\N	\N	\N	false	false	false	false	false	true	false	false	false	false	false	false	false	false	false	false	false	false	\N	true	false	false	false	\N	false	false	false	false	false	true	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	true	false	\N	false	false	false	false	true	false	\N	true	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	true	false	false	\N	false	false	false	\N	false	false	false	false	true	false	\N	\N	\N	\N	3	3	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	Vet ikke	false	false	true	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	1	1	1	\N	\N	false	false	Utover Oslofjorden	\N	0	3	false	false	true	false	false	false	false	false	false	false	\N	\N	false	\N	2	\N	false	false	\N	1	\N	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	true	\N	false	false	false	false	false	false	false	false	\N	3	\N	Vet ikke	8	\N	8	\N	4	\N	2	\N	\N	false	\N	false	1	\N	\N	0	2	\N	\N
31	00	10	1953	00101953-01	Kvinesdal	23	O.G.Røed	Vi var på hyttetur, 4 stykker, seinhøstes 1953. Undertegnede, min 5 år ungre bror, bestevenninden mi da og hennes bror. Jeg var 14 år. Det var bekmørkt høstkveld ute. Vi satt og spilte kort ved bordet foran hyttevinduet. Lyskilde i stua; parafinlampe + stearinlys. Slak bakke fra hytta ned til lita avlang tjønn, lave åsrygger stiger nokså bratt fra tjønna på begge sider. Nokså flat åstopp sett fra hytta til venstre for tjønna. Området rundt hytta har vært dyrket mark og oppover åssidene har folk slått gras i uminnelige tider. Den flate åssida til venstre for hytta midtveis på tjønna danner et lite skar mellom to lave fjellformasjoner. Plutselig ble hele heia og hytta innvendig oppyst. Men det opplevdes som en annen form for lys enn dagslys selv om det var like lyst. Lyset kom ikke fra sola men fra denn lysende "ildkula". Lyskula som plutsellig bare var der midt mot øst for hytta i dette skaret så vi alt klart. Denne lysende kula lyste opp hele heia og var der bare helt plutselig. Og like plutselig som lyset var der, kula var der, like plutselig var den vekk og kvelden ute var like bekmørk igjen.\r\n(Se tegning og kart)	\N	\N	\N	true	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	true	false	false	false	\N	false	false	true	false	false	false	false	false	false	\N	false	false	true	false	false	false	false	false	false	false	false	\N	false	true	false	\N	false	false	false	false	false	false	\N	true	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	true	false	false	\N	false	false	false	\N	false	false	false	true	false	false	\N	\N	2	\N	2	2	false	false	true	false	false	false	false	false	false	false	false	true	false	false	false	false	false	false	Annet	false	false	false	true	Ikke	false	false	false	false	false	false	false	false	false	false	false	false	false	false	2	2	2	\N	\N	false	false	Lyset sloknet	\N	0	2	false	true	f