36	00	11	1954	00111954-01	Gjersø bro, Mosseveien	26	\N	Malermester Trygve Jansen hentet i bil fru Gudrun Buflod, som kom fra Trysil for å besøke Jansens i Ski.\r\nVed Gjersø bro på Mosseveien fikk de se en lysende gjenstand med typisk diskosform. Den sirklet omkring og strøk iblant forbi bilen.\r\nUFO-et landet siden ti meter fra bilen som nå hadde stoppet. Det gjorde en helomvending ved landingen. Gjenstanden var ca. to meter tykk på midten. Overdelen hadde en kuppelliknende utbygning. Under stakk det ut noen korte gjenstander.\r\nFargen var gul som en nedadgående sol. Noen mørke felt syntes på siden, markert av lyse partier. Omkring denne kjernen sto en sterkt lysende 40 cm bred ring, farge som smeltende jern. Ut fra beggge sider strålte et slags vinger, sikkert 15 meter lange. De så ut til å være av lysende gass. Når farkosten fløy, forlengtes disse "vingene", og når den sto stille, ble de dradd inn og ble kortere. Etter et par minutter økte lysstyrken, "vingene" ble lengre, og farkosten lettet. Den strøk over bilen og fløy utover sjøen og skogen. Den utstrålte da et grønnskimrende lys. Skogen lyste smaragdgrønn. Hele tiden rørte den seg lydløst. Etter at den var forsvunnet, hørte de et svakt knall. Vitnene kjente seg iaktatt inne fra tallerkenen. Jansen fikk en stikkende, brennende følelse i ansiktet og på hendene, som etter et solbad. Dette varte i et par dager. Fru Buflod var nesten lam i begge armer og kunne knapt løfte håndvesken.\r\nFør Jansen stoppet bilen, så han på armbåndsuret, et presisjonsur som hadde gåt perfekt i ti år. Den viste 18.35. Da Jansen kom hjem, viste klokken fremdeles 18.35. Urmakeren som undersøkte den, sa at uret hadde stoppet å.g.a. overmagnetisering. \r\nVel hjemme ble det oppdaget at bilens farge hadde skiftet fra beige gul til fosforiserende irrgrønn. Samme kveld ble det sett et flygende lys ved Frogn og Langhus.\r\n(Fra Vg)	\N	\N	\N	false	false	false	false	false	true	false	false	false	false	false	false	false	false	false	false	fals