47	00	\N	1957	1957-Vinter-01	Sandnes	13	\N	Ca. 1957 - ca. 12 år gammel - mørk kveld - overskyet - kanskje litt disig? Sto på trappa (mot nord) og tittet tilfeldig? opp på himmelen. Så 5-6? lys som jeg tolket som lysene fra et fly, nesten rett over meg, litt mot nord. Så ingen flykropp.\r\nJeg reagerte på to ting:\r\n1. Avstanden mellom lysene var altfor stor. "Flyet" måtte altså være svært mye lavere enn noe fly jeg hadde sett der jeg bodde. (Ca. 10 km. fra Sola Flystasjon).\r\n2. Det kom ingen lyd. Lysene var i formasjon. Det virket ikke som de gikk så veldig fort da de var like over meg, men etterhvert som de gikk mot SV ble avstanden mellom dem raskt mindre. De forsvant svært raskt - først bak trærne i parken like ved og så antakelig bak en ås - men jeg reagerte på at de forsvant så raskt etter at de kom bak trærne. Avstanden mellom lysene var svært liten da de forsvant. Det hele tok antakelig max 10 sek. Det virket som om formasjonen var den samme hele tiden. Tolket det som at det hele må ha vært ganske lavt. Retningen så ut til å være den samme hele tide. Alle lysene syntes hele tiden.\r\nHar grublet over dette siden da. Har fortalt det til mange. Var medlem av UFO-forening på 60-tallet. \r\nRegner meg for å være ganske nøktern og realistisk, fenomenet var klart og tydelig - og jeg greier ikke å finne noen naturlig forklaring! Fatter ikke hva det skulle kunne forveksles med. Det gjorde sterkt inntrykk og jeg kusker det fortsatt svært godt.\r\nEtter observasjonen løp jeg inn i stua til min far (jeg husker fremdeles nøyaktig hvor han satt) og fortalte oppskjørta hva jeg hadde sett: "Et fly som gikk fryktelig lavt, uten en lyd." En slik historie ble ikke tatt alvorlig - til min store skuffelse.\r\nHadde ikke sett UFO før - og har heller ikke sett noen siden.\r\nEr meget interessert i å finne ut om evt. liknende observasjoner på slutten av 50-tallet. Håper UFO-Norge kan si noe om det.	\N	\N	\N	false	true	false	false	false	false	false	false	false	false	false	false	f