48	00	\N	1957	1957-Vinter-02	Bergen	6	Innsendt	I 1957, like etter at russerne hadde sendt opp sin Sputnik 1, hendte dette jeg nå omsider akter å fortelle.\r\nDet må ha vært i vinterhalvåret. Jeg hadde fotpatrulje i Sentrum mellom 05 og 07 - og jeg befant meg like foran Sporveiskiosken, Vågsalmenning, på min ensomme vandring i morgentimene. Jeg var sogar iferd med å titte opp på uret øverst på Posthuset, da jeg plutselig fikk oppleve noe ganske enestående.\r\nFra nord, såvidt klar av hustakene kom en lysende gjenstand raskt sørover uten en lyd. Den fulgte liksom Strandgaten - og idet den passerte over meg hørtes et kort, men tydelig dempet sus. Jeg merket meg samtidig at det blåhvite lyset fra gjenstanden ble reflektert fra det fuktige ledningsnettet for trolleybussene, som hang over gaten.\r\nI stadig samme høyde for gjenstanden videre sørover Marken. Den fulgte tilsynelatende jernbanelinjen et stykke for så med ett å skjære til venstre rett på Ulrikken, opp langs denne - og så i en elegant bue over fjellet og ut av mitt synsfelt.\r\nDet hele hadde tatt ca. 15 sek. fra jeg så den og til den forsvant. Været var pent, opphold, skyer, våt kjørebane.\r\n\r\nGjenstanden:\r\nSett forfra minnet den mer eller mindre om en vanlig "flygende tallerken", som de blir beskrevet over alt i aviser og ukepresse. Imidlertid kan jeg ikke utelukke at den hadde en annen fasong, da konturene av gjenstanden ikke trådte fram mot den mørke bakgrunnen. Vel virket gjenstanden lysende på avstand, men dette må nok delvis skyldes at jeg så den i mørke. Da den kom nærmere så jeg at gjenstanden selv ikke lyste. Fra enkelte steder på den kom et klart, hvitt lys - bortsett fra undersiden. Rundt denne satt tett i tett, kanskje en sammenhengende kjede av "levende ild" i blåhvitgrønne fargenyanser. Akter var lyset sterkere med en liten spiss rett bak. Dette lyset var mer konstant og gulhvitt av farge.\r\nIdet gjenstanden passerte over meg så jeg den i ca. 70 graders vinkel rett vest. De underste lysene dannet da en oval som var noe spissere foran enn akter.\r\nGjenstanden virket blå-grønn-hvit - og meget massiv. Jeg har heller aldri tvilt på hva jeg så bl. a. nettopp av den grunn. Det er imidlertid også klart at det meste av gjenstanden så jeg ikke.\r\nJeg anslår gjenstandens høyde over gaten da den passerte meg til mellom 40 og 50 meter. Den skulle da måle ca. 6-7 m tvers over. Var den høyere blir tverrmålet også tilsvarende høyere.\r\nGjenstanden var rett over Nordnes da jeg fikk øye på den. Strekningen jeg fulgte den med øynene kan sannsynligvis bergnes, likeså hastigheten. Den gikk i grunnen ikke så forferdelig fort heller. Jet-jagerne idag har adskillig større fart.\r\n\r\nDenne opplevelsen gjorde selvsagt et meget stort inntrykk på meg, og jeg gikk straks etter inn til politikammeret som da var i Allehelgensgt. 3, og fortalte hendelsen til mine kolleger.	\N	\N	\N	false	false	true	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	true	false	false	false	\N	false	true	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	true	false	\N	false	false	false	false	false	false	true	false	\N	false	false	false	false	true	false	false	false	false	false	false	false	false	false	\N	false	true	false	\N	false	false	false	false	true	false	\N	\N	1	6.5	3	3	true	false	false	false	false	false	false	false	false	false	false	false	false	true	false	false	false	false	Vet ikke	false	false	true	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	1	1	3	\N	45 m.	false	false	Ut av synsfelt.	\N	0	1	true	false	false	false	false	false	false	false	false	false	\N	\N	false	\N	3	\N	false	false	\N	2	\N	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	true	\N	false	false	false	false	false	false	false	false	\N	3	\N	Ikke oppe	7	\N	8	\N	4	\N	0	\N	\N	false	\N	false	1	\N	\N	0	1	\N	