58	00	07	1958	00071958-01	Giske	26	Innsendt	Det jeg vil fortelle er at jeg i juli måned 1958 så et stort romskip som sikkert måtte komme utenfra. Var på ferie på Giske utenfor Ålesund. Jeg holdt på med min radiosender og gikk ut for å se hvordan min senderantenne sto. Bare tilfeldigvis så jeg opp i luften nordover mot Vigra og fikk da se et romskip som kom fra nordøst med sydvestlig kurs. Jeg sprang inn for å hente mitt fotoapparat som jeg regnet med lå i min reisebag. Dessverre så viste det seg at jeg denne gang hadde glemt å ta det med, så jeg tok kikkerten istedet - samtidig som jeg ga beskjed til min søster om å ringe til naboene slik at de også kunne se det. I kikkerten så jeg det meget tydelig. Poståpneren, som tilfeldigvis kom syklende forbi, ble stanset - så han så det også. I det hele var vi seks stykker som så det, og jeg kan si så meget at dersom jeg hadde hatt fotoapparatet med, så skulle der ikke blitt levnet tvil - selv blant de mest skeptiske.\r\nSkipet hadde en sølvgrå farge. Det var ikke vinduer å se, for det undersøkte jeg meget nøye i kikkerten. Med hensyn til farten så er det vanskelig å si, men vi så det i ca. 5 min. Det hadde en ildhale som var av samme diameter som skipet og den var omtrent en tredjepart av skipets lengde. Jeg så meget tydelig at skipet var sylindrisk.\r\nDet var i grunnen ikke sigarformet. Det liknet temmelig nær disse store blyantreklamene som man tidligere så oppsatt på forskjellige steder.\r\n(Se tegning)	\N	\N	\N	false	true	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	true	false	\N	false	false	false	false	false	false	false	false	true	Sølvgrå	true	false	false	false	false	false	false	false	false	false	false	\N	false	false	true	\N	false	false	false	false	true	false	\N	false	false	false	false	false	false	true	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	true	false	\N	false	false	true	\N	false	false	false	false	true	false	\N	\