103	12	03	1965	12031965-01	Gressbakken	4	K. Rønning	Vi kom kjørende i bil om kvelden 12.3, og hadde nettopp stoppet ved gressbakken da vi plutselig fikk øye på et lysende objekt i nordvestlig retning, ca. 30-35 grader over horisonten. Vi ble fort klar over at det ikke var en stjerne, men i løpet av de første 5 min. av observasjonen blusset lyset opp tre ganger i noen sek. Lysstyrken holdt seg deretter konstant i noen min., og begynte så å avta for til slutt å bli så svak at objektet ikke lenger var synlig. Mens observasjonen varte hadde skylaget forandret seg, og skyer av forskjellig "tyngde" hadde passert objektet uten at dette hadde noen innvirkning på lysstyrken.	\N	\N	\N	false	false	false	false	false	true	false	false	false	false	false	false	false	false	false	false	false	false	\N	true	false	false	false	\N	true	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	true	false	\N	false	false	false	false	true	false	\N	false	false	false	true	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	true	false	false	\N	false	true	false	\N	true	false	false	false	false	false	\N	\N	2	\N	3	3	false	false	false	false	false	false	false	true	false	false	false	false	false	false	false	false	true	false	Annet	false	false	false	true	Ikke	false	false	false	false	false	false	false	false	false	false	false	false	false	false	2	2	2	\N	\N	false	false	Avtok gradvis i styrke.	\N	0	1	true	false	false	false	false	false	false	false	false	false	\N	\N	false	\N	2	\N	false	false	\N	5	Overskyet	false	false	false	false	false	false	false	false	false	\N	false	false	false	true	false	false	Liten kuling	false	false	false	false	false	false	false	false	\N	3	\N	Ikke oppe	7	\N	6	\N	4	Jeg har ikke sett noe liknende før, og kan ikke identifisere det.	2	\N	\N	false	\N	false	1	23.40	20 min.	32	2	\N	\N
104	16	03	1965	16031965-01	2 km. nord for Bodø.	9	K. Rønning	Observatøren kjørte med sin bil til utkanten av byen med formål å observere. Været var nydelig, fullmåne og helt klart. Han var nettopp kommet ut av sin bil og står vendt mot vest da det kommer et objekt til syne i nærheten av syvstjernen. Han tror først det må være et stjerneskudd, men ser så atetter at lyset var blitt borte, så tennes det atter, og obj. har nå en fast østlig kurs, og lyset blir ved å tennes og slukkes med faste mellomrom. ( Ca 3 sek. mellom hver gang lyset tennes ) Obj. er omtrent på størrelse med ECHO II (muligens noe mindre ) og lyset, når dette tennes, er av fast karakter og gulhvitt. Observatøren tar så sin kikkert (7*50) og forsøker å holde obj. i denne, men det lykkes bare et kort øyeblikk på grunn av den store hastigheten. Han gir opp å bruke kikkert, og følger obj. med øynene til dette forsvinner bak en åsrygg i østlig retning. Observasjonen varte ca. 30 sek. og det syntes som objektet fulgte en svakt krummet bane med konstant hastighet. Observatøren har forresten ved tidligere anledninger også vært på samme sted for å kikke etter slike ting, da dette sted ligger usjenert av byens lys.	\N	\N	\N	false	true	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	true	false	false	false	\N	false	false	true	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	true	false	\N	false	false	false	false	false	true	Sterkt	false	false	false	false	false	false	false	true	Se beskr.	false	false	false	false	false	false	false	false	false	false	false	true	false	false	\N	false	true	false	\N	false	false	false	false	false	true	Se beskr.	\N	2	\N	3	3	false	false	false	false	false	false	false	true	false	false	false	true	false	false	false	false	false	false	Vet ikke	false	false	true	false	\N	false	false	false	false	true	false	false	false	false	false	false	true	false	false	2	2	2	\N	\N	false	false	\N	\N	0	1	