108	06	07	1965	06071965-01	Atlanterhavet	26	Innsendt	Tirsdag, den 6. juli 1965. På reise fra Puerto la Cruz, Venezuela til Santa Cruz de Tenerife, Kanariøyene. Kl 21.52 var skipets posisjon N 24 gr. 40' W 31 gr. 15'. Nordøstlig vind, styrke 5 - lave såteskyer, som drev i retning med vinden. Barometer 1023. Temperatur + 23 gr. C.\r\nKl. 21.52 ble det av utkikken på babord brovinge rapporterte en lysende gjenstand på himmelen i nordlig retning.\r\nIdet jeg kom ut på babord brovinge fikk jeg se en intens blå ildtunge som med voldsom hastighet kom mot skipet. Jeg løp til telefonen og ringte til kapteinen, og uten å vente på svar tok jeg kikkerten og løp ut på styrbord brovinge og fikk da se gjenstanden gjennom kikkerten, idet den passerte skipet.\r\nGjenstanden passerte like akterfor skipet i en høyde av ca. 200-400 m., og gikk lavt under skyene. Det var stjerneklart og måneskinn mellom de lave skyene og jeg kunne tydelig se konturen av legemets overkant.\r\nDet hadde form som en sigar, og jeg kunne tydelig se en rekke med firkantete vinduer, og det lyste et svakt, gulorangefarget lys fra innsiden. Det var ingen tegn til vinger eller ror. Gjenstanden hadde en blåaktig ildtunge etter seg, som var mest konsentrert ved halen, og litt aktenfor videt det seg ut. Litt lenger aktenfor legemet kunne jeg se et utall av lysende kuler og fra hver kule strålte det ut en blå stråle i retning fra legemet. Ildtungens lengde antas å være ca. 100 m.\r\nGjenstanden syntes å være mye større enn de hittil kjente flytyper..\r\nGjenstanden hadde en enorm hastighet og var synlig i omtrent 30-40 sekunder, og beveget seg på denne tid fra nord- til sydhorisont. Til tross til den enorme hastighet og den nære passering kunne vi ikke høre den minste lyd.\r\nUtkikken på babord brovinge, matros Hernandes Ambrosio, hevder at først så ut som om gjenstanden lettet fra vannet og styrte nordover, og deretter plutselig forandret kurs mot oss.\r\nRormannen, jungmann Narciso Guillen, fikk også høve til å se gjenstanden like etter at den hadde passert skipet.\r\nPå poopen ble legemet observert av reparatør Juan Hernandes og messemann Ignacio Suares. Deres beretninger stemmer helt overens med min. \r\nJeg kan med sikkerhet si at det ikke dreier seg om et vanlig fly, rakett, meteor eller kulelyn.\r\n++brevveksling.	\N	\N	\N	false	false	false	false	false	false	true	false	false	false	false	false	false	false	false	false	false	false	\N	true	false	false	false	\N	false	false	false	false	false	false	false	true	false	\N	true	false	false	false	false	false	false	false	false	false	false	Blåflammet	false	true	false	\N	false	false	false	false	true	false	\N	false	false	false	false	false	false	true	false	\N	false	false	false	false	false	false	false	false	false	false	false	true	false	false	\N	false	true	false	\N	false	false	false	false	true	false	\N	\N	1	\N	3	3	true	false	false	false	false	false	false	false	false	false	false	false	false	true	false	false	false	false	Vet ikke	false	false	true	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	1	1	3	\N	\N	false	false	\N	\N	0	1	true	false	false	false	false	false	false	false	false	false	\N	\N	false	\N	2	\N	false	false	\N	1	\N	false	false	false	false	false	false	false	false	false	\N	false	true	false	false	false	false	\N	false	false	false	false	false	false	false	false	+23 gr C	3	\N	Ikke oppe	7	\N	8	\N	4	\N	3	\N	\N	false	Tirsdag	false	1	21.52	30 sek.	0	4	\N	\N
