264	11	07	1971	11071971-01	Lillestrøm	2	Innsendt	Det gjelder den gjenstanden som ble sett over Rælingen den 11. juli. Jeg bor i Lillestrøm, og vårt soveværelse er rett mot Rælingsåsen. Søndag den 11. skulle jeg altså gå til sengs, og kl. var nøyaktig 23.00. Av gammel vane kastet jeg et blikk ut av vinduet for å se hvordan været var, og  fikk da øye på noe som sto rett over åsen. Rælingsåsen var som en mørk silhuett og sommernatt himmelen var lys rundt åsene - så lys at ingen stjerner var å se. Der - rett fram - sto det noe - bom rolig, og lyste gult - med ett rolig klart lys. Slik sto jeg i ca. 5-6 min. og så på denne lyskilden som jeg aldri før har sett. Jeg gikk vekk fra vinduet for å gjøre meg klar for natten. På vei mot sengen, så jeg igjen ut av vinduet, og gjenstanden sto der fortsatt. På nytt studerte jeg den, men fant ingen løsning på hva det kunne være, og etter nye 5 min, gikk jeg og la meg. jeg leste litt og tok en røyk, men av nyskjerrighet, måtte jeg opp for å se på nytt. nå sto jeg ca. 10 min. og studerte denne vakre gjenstanden, en merkelig følelse kom over meg, en følelse som ikke kan forklares. Dette var noe mitt syn aldri før hadde sett, noe helt nytt - noe uforklarlig. Det er synd at man ikke har kikket eller kamera med telelinse i slike anledninger.\r\nAvstanden fra meg og bort til gjenstanden anslår jeg til ca. 12000 meter, den var ikke rund, men oval, på størrelse av ca. 4-5 stjerner, altså ganske stor.\r\nfargen var gul, men med en kobberrød glans. Den sto helt rolig, og lyset var rolig, men meget klart. Kompassretningen var syd-vest.\r\nJeg gikk og la meg, og fikk ikke se hvor den ble av. Men en ting er sikkert,  jeg har aldri sett noe liknende.	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	fa