140	24	02	1967	24021967-01	Hvalsmoen	26	\N	Det var min sønn som først oppdaget denne merkelige stjernen på himmelen, da vi tok den i nærmere øyesyn så vi at den beveget seg og var gnistrende med mange farger. Vi så på den også med kikkert og det viste seg at det var en stor sprakende gjenstand som beveget seg med ganske sakte fart vestover på himmelen, men med en 15 til 20 minutter mellomrom så det ut for meg som den fikk en utløper som tegnet de merkeligstetrek jeg har sett eller kanskje det var to stykker mellom disse var det en sterk grønn flamme. Den ene utløper steg da oppover på alle verdens tenkelige måter.\r\n(Se skisse.)	\N	\N	\N	true	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	true	false	false	false	\N	false	false	false	false	false	false	false	false	true	Grønn rød blå	false	false	false	false	false	false	false	false	false	false	false	\N	false	true	false	\N	false	false	false	false	true	false	\N	false	false	true	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	true	false	false	\N	false	true	false	\N	false	false	false	false	true	false	\N	1	3	\N	1	3	false	false	false	false	true	true	false	false	false	false	false	false	false	false	true	false	false	false	Vet ikke	false	false	true	false	\N	false	false	false	false	false	true	false	false	false	false	false	false	true	false	3	3	1	\N	\N	false	false	\N	\N	0	2	false	true	false	false	false	false	false	false	false	false	\N	\N	false	\N	2	\N	false	false	\N	1	\N	false	false	false	false	false	false	false	false	false	\N	true	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	\N	3	\N	Ikke oppe	7	\N	8	\N	4	\N	3	\N	\N	false	\N	false	1	22.00	2 t 15 min	49	4	\N	\N
141	02	03	1967	02031967-01	Lillestrøm	2	\N	Jeg ble oppmerksom på et lys på himmelen fra vinduet på gangen. Jeg tenkte først at det var et vanlig utelys, og gikk inn, så kom jeg til å gå ut igjen. Når jeg nå så det igjen tenkte jeg at det aldri har vært noe lys der før. Da jeg begynte å studere dette så jeg at det var på himmelen. Jeg kunne ikke riktig se hvor horisonten gikk med en gang. Kan det være en stjerne, tenkte jeg, nei det er den for stor til. Mens jeg sto og så på den ble jeg klar over at den beveget seg. Det var ikke mye, men da jeg sammenliknet stillingen med pipen på nabohuset så jeg det. Jeg antar at objektet var ca. 1-2 km unna.Etter hvert ble jeg klar over at den hadde en meget stø kurs i jevn høyde. Men denne kursen ble to ganger tett etter hverandre brutt da obj. gjorde 4 hopp, men fortsatte så i den samme kursen. Disse hoppene ble gjort med større hastighet enn mens den beveget seg i den faste kursen. 2 - 3 min. før den ble borte skiftet den til rødt to ganger i perioden av 1 - 2 sek. Med 2 - 3 sek. mellomrom. Da jeg 10 - 15 min. senere så ut var himmelen helt klar.	\N	\N	\N	true	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	true	false	false	false	\N	false	false	false	false	false	false	false	false	true	Hvit og rød	false	false	false	false	false	false	false	false	false	false	false	\N	true	false	false	Skiftet til rød	false	false	false	false	true	false	\N	false	false	true	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	true	false	false	\N	false	true	false	\N	false	false	false	false	false	true	Større enn stjerne	4 cm	3	\N	3	3	false	false	false	false	false	false	false	false	true	false	false	false	false	false	true	false	false	false	Vet ikke	false	false	true	false	\N	false	false	false	false	false	true	false	false	false	false	false	false	true	false	1	1	1	\N	1500 m	false	false	\N	\N	0	2	false	true	false	false	false	false	false	false	false	false	\N	\