206	11	05	1968	11051968-01	Hamburg - Costa Rica	26	Innsendt	Jeg er overstyrmann på Trondheimsskipet FORRA og vi er på reise fra Hamburg til Puerto Limon i Costa Rica. Kl. 00.20 GMT 12/5 (Kl. 19.50 lokal tid) i posisjon 18 gr 06'Nord 68 gr 13' West (Mona Passage) Vår rettvisende kurs 239; opplevde jeg følgende:\r\nInn fra babord med kurs omtrent rett vest kom et flygende objekt. Det så ut til å være ganske nær med høyde ca 7 - 8 gr over horisonten. Det beveget seg med "moderat" fart, men hurtigere enn vanlig fly. Jeg kunne ikke høre en lyd. Det var klarvær og fullmåne med lys horisont. Jeg kunne betrakte gjenstanden i ca. 3 sek., og ganske tydelig. Idet jeg grep kikkerten for å studere det nærmere var det plutselig borte. Jeg tenkte først at det måtte være et fly, men slo fort tanken fra meg, da det er meget usannsynlig.\r\nJeg er meget interessert i ufo-forskning og har aldri sett slikt før. Det var dessverre ingen andre ombord som la merke til dette, og jeg var alene på broa.\r\nJeg skal forsøke å beskrive gjenstanden slik jeg så den: 5 matte, runde, hvite lys med et ganske svakt, men tydelig lysskjær over og under disse og med en slags stripe etter seg (fra fartsretning.) Stripens lengde var vel halvparten av "kroppens" lengde. De klare lysene hang liksom som "perler på en snor".	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	\N	\N	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	f