208	00	\N	1968	1968-Sommer	Båtsfjord	4	Innsendt	Klokken var omkring 17.00 og jeg satt på hybelen min i Båtsfjord, sammen med min kone. Ute var det riktig fint sommervær. Solen skinte fra en skyfri himmel, og det fantes ikke et vindpust. Alt var stille og rolig. Temperaturen kunne være ca. 10-15 grC. Ja, så satt jeg der da, og riktig slappet av, uten å foreta meg noen verdens ting, mens min kone var opptatt med ett eller annet på samme rom som meg. Jeg satt ca. 5 m. fra det ene vinduet, med ansiktet vendt mot det.\r\nDa med ett fikk jeg øye på noe. Dat var en liten rund gjenstand som sto helt stille utenfor vinduet vårt, i andre etasje som vi bodde i. Min første tanke var at det sikkert bare var noen unger som lekte med ett eller annet. men jeg ble snart klar over at det ikke kunne være det like vel, så jeg skyndte meg bort til vinduet for å se nærmere på dette. Et øyeblikk sto jeg helt fascinert og så på dette merkelige. Så lukket jeg opp vinduet for å se bedre. Gjenstanden sto fortsatt helt stille i lufta. Den befant seg ca. 1/2 meter fra meg, og jeg kunne godt tatt i den med bare nevene. Men siden jeg ikke ante hva det var for noe, eller hva som ville skje, så turde jeg rett og slett ikke.\r\nPå bakken under meg kunne jeg se at det satt en liten gutt på 3-4 år og lekte i sanden, helt uanfektet til det jeg var vitne til. Well, jeg sto altså der og så på denne rare gjenstanden. Den var rund og ca. 8-10 cm. i diameter. Den hadde enslags helt svak grønnfarge, og var gjennomsiktig. Den var lysest ute ved sidene, og ble noe skarpere mot midten. Farven kan kanskje mest sammenliknes med sjøvann. Midt inne i gjenstanden var enslags kjerne på 2-3 cm. i diameter som vibrerte på en underlig måte, og lyste og blinket i alle regnbuens farger. Også denne kjernen så ut til å være mørkest mot midten. Denne var ikke rund, men så ut til stadig å skifte form og farge på grunn av vibrasjonen. Det jeg mest kan sammenlikne gjenstanden med er en stor såpeboble med noe inni, men det var det altså ikke.\r\nHele tiden mens jeg så på den hadde jeg en uhyggelig følelse av at det var noe som sto og stirret på meg. Tanken streifet meg at jeg skulle ta noe, en pinne eller noe slikt, for å røre borti dette, men jeg ombestemte meg da jeg ikke visste hvilke konsekvenser dette ville få.\r\nJeg vet ikke hvor lenge jeg sto og så på dette uten å foreta meg noe. kanskje 5 sek., neppe lenger. Så med ett begynte den å bevege svakt på seg. Først små, tilsynelatende helt ubestemte bevegelser. Så med ett begynte den å gå ganske sakte, eller la oss si med en fart av ca. 10 km/t, i noen nøyaktig avmålte spiraler ned mot bakken som lå ca. 5 m. nedenfor vinduet. Den brukte vel en 3 - 4 runder ned tenker jeg, og fløy rett over hodet på den lille gutten som lekte i sanden. Og så begynte den å stige opp igjen, fremdeles i nøyaktig spiralform. Hastigheten var den samme hele tiden, helt til den kom i høyde med vinduet vårt, og igjen befant seg ca. 1/2 m. fra meg. Da med ett satt den opp en voldsom fart, og gikk rett ut til den kom klar av hjørnet på nabohuset, så tok den en brå sving i 90 gr, og på et øyeblikk var den ute av syne for meg. Hele tiden mens jeg så den oppførte den seg absolutt lydløst, også under denne voldsomme akselerasjonen.\r\nIngen andre enn  jeg så den. Min kone, som nevnt befant seg i samme rom som meg, spurte hva det var jeg så, men jeg kom meg ikke til å svare henne, eller gjøre henne oppmerksom på den. Og når jeg sier at hele opplevelsen tok noen få sekunder, (kanskje 10 - 15 sek., vet jeg ikke sikkert). så er det kanskje lettere å forstå at jeg ikke fikk sagt noe til henne før det var for sent.\r\nFor meg virket det som om gjenstanden var fjernstyrt, eller ble styrt av et eller annet.\r\nJeg bør vel også opplyse at huset som vi bodde i, lå rett ved siden av et annet 2 etg. hus. Det var ca. 5 - 10 m. mellom husene, og det var mellom disse to husene at gjenstanden beveget seg i en spiralform, slik at den startet fra vindushøyde i 2. etg. og etter 3 - 4 runder nedover var den ca. 1 m. over bakken. Uten stopp, begynte den å gå opp igjen. Etter 3 - 4 runder var den der den startet, og satte altså opp denne forferdelige farten og var borte.\r\nHver runde den tok mellom husene kunne vel ha en diameter på ca. 7 - 9 m., slik at den ikke kom nærmere noen av husene enn ca. 1/2 m.	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	\N	\N	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	0	0	0	\N	\N	false	false	\N	\N	0	0	false	false	false	false	false	false	false	false	false	false	\N	\N	false	\N	0	\N	false	false	\N	0	\N	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	0	\N	\N	false	\N	false	0	17.00	\N	0	0	\N	\N
