212	23	09	1968	23091968-01	Mosheim	26	Innsendt	Vi iakttok i kveld, kl. 20.30 - kl. 20.35 et fenomen på himmelen som vi føler oss pliktige til å rapportere.\r\nFra Mosheim, ca. 3 km. nord for Brønnøysund, så vi i retning nord fire eksplosjonsaktige lysfenomener i jevn rekkefølge, hver gang på et nytt sted på himmelen i et konsentrert område. Avstanden er umulig å si nøyaktig, men en lys sky etter hvert "blaff" flyttet seg tydelig i vindens retning, noe som gjør at vi kan si at det foregikk i den lavere del av atmosfæren. Skyene flyttet seg omtrent som ekshauststripen etter et jetfly i stor høyde.\r\nHvert fenomen foregikk på samme måten. Et lite rødt lys kom plutselig til syne på størrelse med de fire midterste stjernene i Sjustjerna, som sto lavt på himmelen i øst, og var lett å sammenlikne med. Dette lyset gikk hurtig over i orange og gult og tilslutt blått for deretter å slukne og etterlate en for oss tilsynelatende kuleformet sky, som sakte oppløses og drev med vinden. Dette foregikk i en høyde på ca. 40 gr. Lysstyrken på det sterkeste, ved orangefargestadiet, kan sammenliknes med månens, noe i underkant kanskje, månen var ikke synlig, så dette er noe flytende. Eksplosjonen kunne ta omtrent 2 sekunder og på den tiden økte den 3 - 4 ganger i volum.	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	\N	\N	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	fal