286	00	12	1971	1971-Romjul	Haugesund	13	Innsendt	Undertegnede som i 3 netter før nyttårsaften gikk nattvakt på et skip beliggende ved Haugesund mek. verksted. Så en natt en for meg ukjent lysende gjenstand. Den var halvveis over himmelhvelvet da jeg oppdaget den og min første tanke var at det måtte være en meteoritt. Kursen var stø fra omkring NV til SV. Den lyste klart og jevnt som en planet. Der var ingen dur eller annen lyd å høre fra gjenstanden.\r\nHeller ikke så jeg noen hale eller andre lysende gjenstander som beveget seg i nærheten. Den fortsatte over himmelhvelvingen så lenge jeg kunne følge den med øynene, og den sloknet ikke som et "stjerneskudd".\r\nFarten var heller ikke på langt nær så stor som den vi vanligvis forskrider med et såkalt "stjerneskudd", men jeg syntes kanskje at den var litt stor til fly å være.\r\nJeg undret meg over fenomenet, men kom til at det måtte være et fly og tenkte meg at kursen kunne tyde på at det kunne være et rutefly som kom inn fra Nord-Atlanteren. At jeg ikke så sidelanterner eller den blinkende akterlanternen som fly pleier å ha trodde jeg kom av den store høyden. Det var klart måneskinn og skyfri himmel og jeg tenkte meg at et for eksempel aluminiumsplate fly kunne fortone seg slik lysende i måneskinnet. Jeg så ikke på klokken, men det var litt over midnatt tror jeg. I det jeg som nevnt antok at det måtte være et fly tenkte jeg ikke stort mer på saken, og jeg er nu derfor ikke sikker på om det var natten før nyttårsaften eller om det var natten til den 30. desember. Jeg nevnte saken for min kone da jeg kom hjem fra vakt, men hun kan heller ikke huske hvilken natt det var. Ellers har jeg ikke nevnt saken til noen andre.\r\nI fjernsyn og aviser så eller hørte jeg om disse lysende gjenstandene som var observert natten til 1. nyttårsdag, og at NTB. var interessert i opplysninger om eller observasjoner om slikt, og jeg hadde tenkt å skrive i går.\r\nDa så det imidlertid i avisene ut for at saken var oppklart og opp og avgjort. I dag så det iallfall i en lokalavis her, ut for at disse gjenstandene fremdeles diskuteres, og jeg sender derfor disse linjer til NTB. i tilfelle man skulle ha interesse av det. Selv om det ikke, som sagt gjelder nyttårsaften.	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	\N	\N	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	0	0	0	\N	\N	false	false	\N	\N	0	0	false	false	false	false	false	false	false	false	false	false	\N	\N	false	\N	0	\N	false	false	\N	0	\N	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	0	\N	\N	false	\N	false	0	\N	\N	0	0	\N	\N
