294	01	01	1972	01011972-04	Haugesund	13	Innsendt	Litt før klokken 04.30 den 1/1-72 så jeg sammen med to venner noe uforklarlig på himmelen over Haugesund. Med det samme slo vi det vekk som en vits at det måtte være ufoer, men da det dagen etter ble meldt i nyhetene at det var sett ufoer over hele Sør-Norge på den tiden, vil jeg gjerne få gitt Dem rapport om det - om det da kan være til noen nytte.\r\nJeg ble plutselig oppmerksom på to lysende fenomener på nordhimmelen. Vi ropte på en tredjemann som satt inne i stua.\r\nLysene sto ikke så høyt over horisonten. Å gi seg til å bedømme avstand og høyde blir bare gjettverk - men de så ut til å være langt borte.\r\nDet dreide seg om to lysende "gjenstander". Av utseende kune de mest av alt minne om to kometer, men de var adskillig mindre og adskillig mer lyssterke. Det var et klart, hvitt lysende hode på hver, og en hale som skal i gult/orange. I den øverste av de to halene blinket en stund et grønt lys. Halene virket mer som "stjerneslør".\r\nDe beveget seg med helt jevn fart fra nord mot øst og sør i en bane som virket meget svakt fallende. Mens de beveget seg, holdt de samme avstand fra hverandre hele tiden, og de holdt også samme fart. farten kunne minne om jetfly.	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	\N	\N	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false