345	01	01	1972	01011972-53	Solør	26	\N	Halen til gjenstandene var altså kraftig rød og ble straks mye bredere enn f.eks. av jetfly. Den liknet mer på bildet av raketthalen til månerakettenes 2. trinn, jeg la straks merke til denne forskjellen i forhold til jetfly f.eks.. Lengden kan jeg tenke meg var som normalt for jetfly jeg har sett i den høyde jeg anslo gjenstandene hadde.\r\nTatt i betraktning at det var måneskinn, fullmåne, går jeg ut ifra at det var et ganske intenst lys i fronten av gjenstandene. Som før nevnt var lyset blåhvitt, men ikke så kraftig at det var ubehagelig å se på.\r\nGjenstandene hadde samme formasjon så lenge jeg hadde mulighet til å iaktta dem, om jeg skulle driste meg til å antyde hva jeg syntes det mest sannsynlig måtte være, så kan jeg ikke fri meg for at det måtte dreie seg om gjenstander dirigert av intelligente vesener, og at halen var rekylgass fra raketter.	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	\N	\N	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	0	0	0	\N	\N	false	false	\N	\N	0	0	false	false	false	false	false	false	false	false	false	false	\N	\N	false	\N	0	\N	false	false	\N	0	\N	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	0	\N	\N	false	Lørdag