346	01	01	1972	01011972-54	Årvoll	26	S. Wiseth	Jeg oppdaget formasjonen mens jeg kjørte drosje, og stoppet. Mine passasjerer så det samme. Det kom fra nord og gikk mot syd, omtrent rett over hodet vårt. Det ble ikke tid til noen nærmere observasjon, men både mine passasjerer og jeg undret oss over hendelsen. Jeg holdt ikke øye med objektene til de forsvant, dessverre.	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	\N	\N	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	0	0	0	\N	\N	false	false	\N	\N	0	0	false	false	false	false	false	false	false	false	false	false	\N	\N	false	\N	0	\N	false	false	\N	0	\N	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	0	\N	\N	false	Lørdag	false	0	04.30	\N	0	0	\N	\N
347	01	01	1972	01011972-55	Lillehammer	10	Haltuff	Jeg la meg litt over midnatt etter å ha sett på fyrverkeriene. Så våknet jeg rent tilfeldig og kikket ut av vinduet som vender mot vest, men fra sengen ser jeg nordvestover. Jeg så da noe som jeg først trodde var en rakett, men da den fortsatte i uendret bane skjønte jeg at det måtte være noe annet, og kom meg ut av sengen. Utenfor vinduet er en altan langs hele vestsiden av huset. Da fenomenet forsvant over taket vekket jeg min kone, fikk litt klær på meg og gikk til husets sydvestre hjørne og då fenomenet igjen inntil det forsvant nær sydøst. Det virket ikke større da jeg så det høyest på himmelne enn da det var nærmest horisonten og jeg mente derfor at det måtte gå meget høyt.\r\nPga. halen tankte jeg først på en komet, men hadde ikke forestilt meg dem slik og bestemte meg for å lese om kometer neste dag. Meteorer trodde jeg ikke ville ha en så horisontal bane, men visste også for lite om dem. En ukjent type spionfly, ubemannede, var også noe som streifet tanken, men vanlige jetfly mente jeg måtte være utelukket. Jeg holdt en satellitt som tapte høyde og streifet inn i atmosfæren for mest sannsynlig, men sikker var jeg på ingen måte.	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	\N	\N	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	0	0	0	\N	\N	false	false	\N	