350	01	01	1972	01011972-57	Hamar	5	A. Børcke	Alle sju gjenstandene strålte samme lys. De tre nederste gjenstandene dukket opp 4-5 grader lenger ned på himmelhvelvingen etter at de fire første var forsvunnet. De holdt samme kurs og omtrent samme hastighet.\r\nFire objekter dukket opp omtrent samtidig midt på himmelhvelvingen og beveget seg i formasjon ved siden av hverandre til ca. 60 prosent av halve himmelhvelvingen var tilbakelagt, hele tiden sørlig retning. Ti sekunder etter at de var forsvunnet, dukket 3 lysende gjenstander opp, denne gangen lå de på loddrett linje og va bundet sammen av små lysende prikker, fortsatte i samme kurs og med samme hastighet til ca. 20 grader over horisonten da de forsvant. Samlet observasjonstid ca. 2 min.	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	\N	\N	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	0	0	0	\N	\N	false	false	\N	\N	0	0	false	false	false	false	false	false	false	false	false	false	\N	\N	false	\N	0	\N	false	false	\N	0	\N	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	0	\N	\N	false	Lørdag	false	0	04.00	2 min.	0	0	\N	\N
