394	12	02	1972	12021972-01	Borgenhøy, Holter	26	K. Christensen	Etter ufoen 080771 som jeg ikke fikk summet meg til å filme, var jeg nå meget hurtig ute og filmet denne gangen. Dette lykkes godt og fenomenet så ut som en sopp med mange farger. Det mest fremtredende er orange gult, men det er også hvitt, grønt og blått tilstede. (Disse fargene kan ikke ses så godt på bildene som er avfotografert.) Men jeg har slides hvor alle fargene kommer godt frem. På filmen gjør Soppen mange rare bevegelser blant annet et stort sprang (hopp). Når man studerer enkelt-bilder kan man se at lyset fra objektet varierer i styrke fra bilde til bilde.\r\nDette kommer ikke så godt frem når en studerer under kjøring med vanlig hastighet. Objektet kom fra nord, da det var nord for meg  satte det kursen mot nord. Dette varte bare en liten stund snart kom det mot sør igjen. Like etterpå tok det et hopp til høyre samtidig som det steg under hoppet. like etterpå satte det opp en meget stor fart mot nord.\r\nNår en ser bilde til bilde ser man tydelig objektet bli mindre og mindre. På et par sek. er det helt ute av syne. Filmhastigheten er 18 bilder per sek. På filmen er det føyet til opptak av fly for at den store forskjellen skal komme frem.	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	\N	\N	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	