419	12	09	1972	12091972-01	Ålen	17	\N	Vi var på vei til Ålen fra Trondheim. Kl. 02.30 ble vi ved Reitstøa oppmerksom på en stor lysende gjenstand på venstre side av veien ca. 7-800 m. opp i lufta. Vi kjørte da langsomt en stund og så satte farten opp igjen, og det samme gjorde den lysende gjenstand. Vi stoppet og gikk ut for å høre om det var noen lyd, men det var det ikke. Vi fortsatte og da vi kom opp i Dragåsen mellom Reitstøa og Haltdalen kom det i full fart over biltaket (litt lavere enn vanlig) og forsvant over en ås på høyre side av veien. Det ble da borte noen min., og det kom da tilsyne igjen på venstre side. over tretoppene nede i Haltdalen lyste det et blåaktig skjær. Det forsvant igjen oppe i Svelgen i øvre Haltdalen. Ved Eide bro kom det tilsyne igjen og fulgte etter heilt til Graftås hvor vi skulle overnatte. Gjenstanden stoppet rett i øst.\r\nvi gikk etter kikkerten, og da så du konturene og flammene meget godt. Lysene på bilen ble slokt, og gjenstanden sto der fortsatt, og ikke kom bort som det ble skrevet i Arbeidets rett. Vi så lyset ca. en halv time, da det kom en sky foran og det ble borte ca. 10 min. Etter at skyen seilte bort var det fortsatt usynlig noen min. Da det plutselig kom tilsyne igjen. Det var da det dreide om og den flate siden kom opp, men så endret det retning på ny, og flatsiden kom mot nord igjen. Noen sek. trakk det østover og ble som et lite lys, men så kom det med stor hastighet tilbake. Det sto da stille og blafret veldig. Kl. ble 04.00 da vi sluttet å iaktta gjenstanden, men den sto fortsatt på samme rom. I kikkerten så var lyset blendende og veldig skarpt.	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	false	false	false	false	false	false	false