490	04	10	1973	04101973-01	Trysil	26	P. Ottesen	Vitnet sto ved det åpne vinduet, da hun la merke til at det liksom i puljer kom dalende lange tynne tråder (sølvaktig) ned fra himmelen. Disse trådene, nesten tynne som spindelvev, hengte seg opp i lystrådende og i furuskogen omkring. Mens hun holdt øye med dette fenomenet, kom det først sakte dalende en hvit kule nærmest som et stort egg inne i vevet. Denne dalte ned ved uthuset. Da den sorte kulen også like t egg og også sammen med en "pulje" av spindelvevet kom dalende sakte på samme måten, sprang vitnet ut, men kulene var ikke å se, selv om hun er helt sikker på at de  landet. Det var heller ikke noe spor etter dem. Spindelvevet som hopet seg opp i store mengder, hang hele dagen, men det kom ikke mer vev etter at den svarte kula hadde landet.	\N	\N	\N	true	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	true	false	\N	false	false	false	false	false	false	false	false	true	se beskr.	false	false	false	false	false	false	false	false	false	false	false	\N	false	true	false	\N	false	false	false	false	false	true	Ikke lys	false	false	false	false	false	false	false	true	Ikke lys	false	false	false	false	false	false	false	false	false	false	false	true	false	false	\N	false	true	false	\N	false	false	false	false	false	false	\N	10 cm.	3	0,10	3	3	false	false	false	false	false	true	false	false	false	false	false	false	false	false	false	false	false	false	Vet ikke	false	false	true	false	\N	false	false	false	false	true	false	false	false	false	false	false	false	false	true	2	1	2	\N	35 m.	false	false	De så ut til å lande på sørsiden av uthuset, men da vitnet kom dit bort, var de borte.	\N	0	1	true	false	false	false	false	false	false	false	false	false	\N	\N	false	\N	2	\N	false	false	\N	1	\N	false	false	false	false	false	false	false	false	false	\N	true	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	+20 grC.	1	\N	Til høyre	4	\N	8	\N	4	ufo? Umulig 