491	10	10	1973	10101973-01	Hønefoss	3	A. Børcke.	Jeg sto i vinduet som vender ut mot NØ, for å se en kamerat vel avgårde. I det han kjører nedover gaten, oppdager jeg et lysende objekt på natthimmelen mot NNØ. Det var kaldt og stjerneklart. Jeg ropte på min kone, som kom og så det samme. Jeg trodde først det var et fly som hadde en lyskaster på, og åpnet derfor vinduet for å høre etter noen lyd. Det var ingen lyd å høre. Det var heller ingen andre lys å se på objektet. Det var heller ingenting å se utenom lyset (som ble opplyst). Objektet ble borte bakom bygningen vi bor i, og ble videre skjult bak en haug. Høyden over horisonten var ikke stor. Hastigheten var som på et propelldrevet fly.\r\nJeg har aldri sett et fly som har hatt noen lyskaster på tidligere, men jeg antok at det måtte se slik ut hvis det hadde hatt noen på.\r\nLandingslys på fly har jeg sett, men dette så ikke slik ut.	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	\N	\N	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	0	0	0	\N	\N	false	false	\N	\N	0	0	false	false	false	false	false	false	false	false	false	false	\N	\N	false	\N	0	\N	false	false	\N	0	\N	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	0	\N	\N	false	Onsdag	true