579	06	02	1975	06021975-01	Vesterålen	9	\N	Hendelsen skjedde på veg til arbeid. Vi var to biler på veg til arbeid, jeg lå bakerst, foran meg kjørte en arbeidskamerat. Det var svært dårlig vær den morgenen, noe som jeg senere har brukt til å forklare hendelsen. Vi var akkurat passert et bolighus nesten innerst i Slotnesbogen, da et voldsomt bråk oppstod. Samstundes oppdaget jeg et lysglimt på himmelen til høyre for meg. Jeg kan ikke huske hvor lenge lyset varte, men jeg antar at det var kortvarig. Jeg kan huske at det som senere viste seg å være sand som ble slengt mot bilen varte ganske kort tid.\r\nLysglimtet mener jeg var gulhvitt av farge og ganske sterkt. Bilene våre ble svært ødelagt. Lakken på bilene var helt borte som de var sandblåste. I tillegg var lyktene knust, jeg synes å huske at frontruten på Olsens bil ble knust. Jeg har i alle disse årene ansett hendelsen som naturlig da det skjedde under dårlige værforhold. I tillegg skjedde det på et sted hvor det kan være et ganske kraftig fallvær. dvs.: Kraftige ujevne vinder som ofte danner hvirvelvinder. Jeg mener vi havnet i en slik vind og at lysglimtet var overslag på en kraftlinje (lavspent), som ligger i samme retning som lyset ble observert. På den annen side har ikke en slik hendelse skjedd verken før eller senere som jeg vet om.	\N	\N	\N	false	true	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	true	false	false	false	\N	false	false	true	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	true	false	\N	false	false	false	true	false	false	\N	true	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	true	false	false	\N	false	true	false	\N	false	false	false	false	true	false	\N	\N	3	\N	3	3	false	false	true	false	false	false	false	false	false	false	false	true	false	false	false	false	false	false	vet ikke	false	false	true	false	\N	false	false	