724	00	09	1976	00091976-01	Hurum	3	\N	Jeg var på vei hjem om kvelden ca. kl. 23, på en strekning jeg har kjørt menge ganger. det var helt mørkt, ingen stjerner e.l. men oppholdsvær. På en bakketopp får jeg øye på et sterkt lys oppe i åsen til venstre for meg. Jeg tenkte for meg selv: Det er rart jeg aldri har lagt merke til at det er et hus der oppe? Kjører litt videre og da ser at det sterke lyset kommer mot meg inn over tretoppene. Det var så sterkt som en mange hundre watt lyspære, men ikke ubehagelig å se på. Så stopper lyset rett til vestre for meg, og da får jeg panikk. Jeg ser og ser og kan ikke tro mine egne øyne. Da flytter det seg helt lydløst en 100 m. tilbake fra der det kom fra. Jeg kjenner at nå kommer panikken totalt, for da flytter det seg til midt over veien og blir hengende rett over veibanen der jeg skal kjøre, og i en høyde slik at jeg ikke kan komme under uten å kjøre inn i det. Det hadde en diameter større enn veibredden, ovalt med et intenst lys og noen sorte punkter på midten.\r\nDa lukket jeg øynene og niholdt i rattet på bilen og sa: Vær snill og kjør meg hjem…. Jeg ga på det jeg hadde og kan ikke huske noe før jeg kommer til Sætre. Dagen etter hadde jeg et stort rundt rødt, tørt utslett på armen. Det tok flere uker før det ble borte. Det som var rarere at når jeg så på armbåndsuret mitt, vanlig opptrekksur, begynte viserne å gå i full fart rundt den gale veien og stoppet på det klokkeslettet jeg hadde mitt livs opplevelse dagen før. Radioen i bilen som i alle år har vært helt fin, virket fra den dagen aldri mer til vi skrapet bilen. Den gangen torde man ikke snakke om slike opplevelser til noen annen enn nærmeste familie, for da var man jo gal, derfor har jeg ikke meldt om dette tidligere, men familien og nære venner har jo forstått at jeg har sett noe som jeg ikke kan forklare, min mann så meg i det jeg kommer inn døren samme kveld og han var ikke i tvil om at jeg hadde oppdaget noe, etter det uttrykket jeg hadde i ansiktet.	\N	\N	\N	fals