804	03	12	1977	03121977-01	Laksevåg	6	F. Kalvik	Vitnet så ut gjennom vinduet ca. kl. 00.45 for å ta en titt på sin bil før han gikk og la seg. han så denne merkelige "stjernen" og ble forundret, for slik hadde aldri noen stjerne sett ut. Den blinket i flere forskjellige farger. Han gikk og hentet kikkerten og da så han helt tydelig at det var noe fremmed, uforklarlig, og han vekket så son kone for å være vitne til dette. Vi så begge at: Noen stjerne kunne det ikke være. Det var et sterkt, konstant hvitt lys, med jevnt pulserende rødt, grønt og blått lys som blinket i nøyaktig rekkefølge. De minnet om neonlys. Det kunne ikke være noe fly eller helikopter. Lyset beveget seg umerkelig mot høyre skjønt det kunne vi bare merke ved å utgangspunkt i tretoppene hvorover objektet befant seg. Det kom av og til nærmere og fjernet seg av og til. da objektet var på det nærmeste kunne vi tydelig skimte et svakt omriss som minnet om to dype tallerkener lagt mot hverandre. Vi fulgte objektet i kikkert til ca. kl. 01.330. Da var det svært langt borte, men kunne likevel sees da vi gikk til sengs.\r\nDer vi så objektet har det ikke vært noe stjerne før, ei heller siden. Et fly ville beveget seg og blitt borte på kort tid og har dessuten konstante lys. Et helikopter kan det ikke ha vært, da ville vi hørt støy og dessuten kunne helikopter umulig gått så høyt opp med lysene fremdeles synlig.	\N	\N	\N	false	true	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	true	false	false	false	\N	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	true	sterkt	true	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	true	false	false	\N	false	true	false	\N	false	false	false	false	false	false	\N	\N	\N	\N	\N	\N	false	false	false	false	true	false	false	false	false	false	fals