943	05	03	1979	05031979-01	Grand Canaria Playa del I	26	F. Kalvik	Under et ferieopphold på Grand Canaria, var min kone og jeg, pluss min venn vitne til en fascinerende Ufo-observasjon. Ca. kl. 20.00 mandag den 5/3 satte vi oss i bilen på San Augustin for å finne en restaurant med eget strømaggregat, da strømmen hadde vært borte siden kl. 17.00. Ca. kl 20.20 svingte vi ned mot Playa del Ingles, hvor alt var svart bortsett fra et og annet opplyst hotell. Da fikk jeg øye på en enormt sterk "spotlight" til høre for bilen. Jeg sa til min venn at jeg ikke visste at det var idrettstadion på Playa del Ingles, og han sa at det var det ikke heller.\r\nTil min store forskrekkelse så jeg at det intense, sterke lyset begynte å bevege seg sakte nedover mot venstre, og forsvant ned bak en lang mur, hvor vi svingte til høyre. Det vi da ble vitne til, kan ikke sammenliknes med noe noen av oss har sett tidligere. "Spotlighten" eksploderte, og halve himmelen ble dekket av en gråhvit "osteklokke" med orange lys i bunnen, og ut av "osteklokken" for en gjenstand som så ut som en stjernetåke, med mange lysende punkter, med en hastighet som var helt ufattelig. Vi stanset bilen, hoppet ut og så gjenstanden forsvinne i sikksakk ut blant stjernene. Fra den startet, til den ble borte gikk det ca. 5-6 sek. "Osteklokka" løsnet seg langsomt opp, og forsvant etter ca. 10 min., og til slutt lå det bare en lysende boomerang igjen over horisonten.	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	\N	\N	\N	\N	\N	false	false	false