1209	07	01	1983	07011983-01	7087 Gimse, Melhus	8	\N	Da jeg skulle legge barna kl. 20.00, og skulle dra for gardinene ble jeg oppmerksom på et stort gult lyspunkt på himmelen mot sør. Jeg ropte til min kone, og sammen gikk vi ut på kjøkkenet, slukket lysene og lukket døren. Barna kom også. Jeg sprang etter fotoapparatet og gikk ut gjennom en verandadør som vendte mot øst. Objektet var veldig klart lysende, uten blinking av lyset eller flimring. Lyset var konstant. Det var veldig stort. Det står en tv-mast rett imot med tre røde dobbeltlys. Da objektet passerte denne så vi objektet hele tiden, men det midterste røde lyset forsvant, altså passerte objektet på "vår" side av masten. Etter dette økte farten litt, og fulgte rett. Nå mistet vi objektet ute av syne p.g.a.  noen hus. Vi så det igjen på andre siden av husene, og gjennom noen trær. Etter trærne var det ingen hindringer i veien, og vi fulgte objektet helt til det forsvant eller ble oppslukt av lysene over Trondheim. Det ble ikke tatt noe bilde, da det var noen utelys fra naboen som forstyrret. Det var dessuten lang avstand, og objektet beveget seg så fort at jeg ikke fikk tid til å rigge opp noe stativ etc.	\N	\N	\N	true	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	true	false	false	false	\N	false	false	false	false	false	false	false	false	true	som månen	false	false	false	false	false	false	false	false	false	false	false	\N	false	true	false	\N	false	false	true	false	false	false	\N	true	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	true	false	\N	false	true	false	\N	false	false	true	false	false	false	\N	1	1	\N	2	2	false	false	false	false	false	true	false	false	false	false	true	false	false	false	false	false	false	false	fra høyre mot venstre	false	true	false	false	\N	false	false	false	true	false	false	false	false	false	false	true	false	false	false	2	2	1	\N	\N	false	false	\N	\N	0	2	false	true