1210	10	01	1983	10011983-01	9373 Botnhamn	19	L. N. Solhaug	Det var mandag kveld. Min mann hadde alt lagt seg, og jeg var klar for å legge meg. Jeg hadde slukket lysene i stuen, som vender mot syd, men skulle bare inn for å se om alt var i orden med varmen. Da fikk jeg se et stort lys som kom inn fra venstre, det var grønt og hvit-blankt, og det blinket. Jeg mente at det måtte være et helikopter i syketransport siden det var så sent på kvelden. Men så stoppet lyset og sto stille, og det syntes jeg var rart, og da fikk jeg se at det kom et klart rødt lys samtidig som jeg så det grønne lyset og en aura av hvit-blankt lys fra objektet. Jeg gikk da ut på trappen for å høre om det kom noen lyd fra det, men det var helt stille. Jeg tok da kikkerten frem og så på dette denomenet. Det begynte da å bevege seg igjen. Det gikk rett ned, for så å gå opp igjen. Det laget flere figurer. Jeg hentet da min mann, som ennå lå og leste og spurte om han ville se en ufo.	\N	\N	\N	true	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	true	false	false	false	\N	false	false	false	false	false	false	false	false	true	se beskr.	false	false	false	false	false	false	false	false	false	false	false	\N	false	true	false	\N	false	true	false	false	false	false	\N	false	false	false	false	false	false	false	true	uregelmessig bl	false	false	false	false	false	false	false	false	false	false	false	true	false	false	\N	false	true	false	\N	false	false	false	false	true	false	\N	\N	2	\N	2	2	false	false	false	false	true	false	false	false	false	false	false	false	false	true	true	false	false	false	fra venstre mot høyre	true	false	false	false	\N	false	false	false	false	false	true	false	false	false	false	false	false	false	false	1	1	3	\N	\N	false	false	\N	\N	0	2	false	true	false	false	false	false	false	false	false	false	\N	\N	false	\N	2	\N	false	false	\N	1	\N	false	false	false	true	false	false	false	false	false	\N	true	false	false	false	false	false	\N	false	false	false	f