1244	22	09	1983	22091983-01	9510 Elvebakken	4	\N	Jeg var på tur fra Elvebakken til Kronstad, jeg skulle innom en venn av meg, jeg skulle til å svinge inn til huset jeg skulle til, da jeg plutselig fikk øye på en lysende kule.\r\nAv fargen liknet den mye på sporlyskuler, jeg ser helt bort fra Meteor og stjerneskudd, slike fenomener kaster mer lys fra seg, denne gjenstanden var rød av farge, den kom til syne i nordvestlig retning og hadde en kurs rett mot nord. Plutselig delte lyskulen seg, en kule nummer 2 kom til syne til venstre for gjenstanden eller ut av den første gjenstanden. Den dreide av i en kurve på 90 grader rett vest. Observasjonen varte mellom 10 og 20 sek. Klokken var presis 20.26 da jeg observerte fenomenet.\r\nHimmelen var delvis skyet, temperatur mellom 4 og 8 grader +.  Nesten vindstille, hadde det ikke vært for at gjenstanden delte seg hadde aldri denne rapporten blitt sent dere. Å ha et konkret begrep om hva det kunne ha vært overlater jeg til andre å vurdere, samme fenomen skal ha vært observert noen mil vest for Alta, sted Talvik, flere unger skal ha sett samme fenomen der. Dette er i grove trekk det jeg kan komme med av informasjoner til dere.	\N	\N	\N	false	true	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	true	false	false	false	\N	false	false	false	false	true	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	true	false	\N	false	false	false	false	false	false	\N	true	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	true	false	false	\N	false	true	false	\N	true	false	false	false	false	false	\N	\N	\N	\N	2	2	false	false	false	false	false	true	false	false	false	false	false	false	false	false	false	true	true	false	Vet ikke	false	false	true	false	\N	true	false	false	false	false	false	false	false	false	true	false	false	false	false	1	0	0	\N	\N	false	false	\N	\N	0	1	true	false	false	false	f