1283	29	09	1984	29091984-01	2544 Øversjødalen	26	\N	Det var lørdag. 29.9.1984. Kl. litt før 22.00. Jeg var på vei fra Øversjøen gård - retning Øversjødalen. Jeg hadde kjørt ca. 300 meter fra gården da jeg ble oppmerksom på et lysskjær på venstre siderute i bilen. Ved nærmere ettersyn fikk jeg se et ganske kraftig lys i sydlig retning. Jeg stoppet bilen, men ikke motoren og satt og så på dette som raskt kom nærmere. Ved første øyekast så dette ut som en kraftig billys som jo ser ut som en sammenhengende lysbunt på avstand. Når det kom nærmere delte det seg mer opp og ble til tre lys; eller tre skarpere lys i lysbunten. Lyset var mye gult, og rent gyllent i utkantene. lyset gikk skrått nedover omtrent som et fly som går inn for landing, og så ut til å gå mot bakken bak Bjørkelia i min synsretning. På grunn av at jeg var så opptatt med å studere dette, glemte jeg å stoppe bilmotoren så derfor hørte jeg ingen som helst lyder. Derimot et par dager senere fikk jeg høre at to fruer her, den ene lærerinnen her og den andre en Oslofrue som var på hytte her hadde hørt et smell lik et børseskudd akkurat på samme tid som jeg så dette. Min konklusjon ble da at kanskje en satellitt eller deler av en slik var kommet inn i atmosfæren og gått brennende i bakken, eler også en liten meteor.\r\nDet kunne kanskje være en ide å undersøke litt i terrenget om noe skulle finnes. Jeg tror ikke det er så stort område som er aktuelt. Dette er i store trekk hva jeg registrerte. Jeg kan bare legge til at retningen dette lyset (eller gjenstanden) gikk i var nesten rett fra syd mot nord, kanskje en tanke fra øst mot nordvest. Dessuten var det omtrent klarvær og god sikt.	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N