1293	00	10	1952	00101953/53	9600 Hammerfest	19	L. N. Solhaug	Høsten 1952-53 - november var det uvanlig lite sne, med gode forhold for skøyting på fin stålis. En kveld mellom 18 - 19 var jeg på Lillevannet, nærmere bestemt ved utløpet av "Stengselelv" for å prøve skøytene. Stjerneklar himmel, måneskinn, vindstille og ingen utenom lyder for trafikkstøy e.l.\r\nI en avstand av ca. 20 - 30 m. fra land, vanndybde 3 - 4 m, bøyde jeg meg ned for å feste skøytene til skoene. Før jeg fikk festet skøytene merket jeg at det ble uvanlig lyst, kunne se vedetasjonen på bunnen gjennom isen. Da jeg rettet blikket mot himmelen fikk jeg se en sterk lyskilde, ikke blendende, men sterk nok til å lyse opp omgivelsene i en radius av flere hundre meter. Lyskilden hadde form som en tallerken, eller en frisbee, kan ikke si at lyset var pulserende for lyskilden eller gjenstanden hadde en svak roterende horisontal bevegelse.\r\nGjenstanden hadde regnbuens fargeskala - mørkere i sentrum med hovedvekt av grønt som gikk over til grønngult lys i ytterkant av "tallerkenen". Ser en bort fra den svake roterende bevegelse sto den helt stille, ingen horisontal eller vertikal bevegelse.\r\nAvstanden kunne virke som i høyden 50 m. rett over der jeg sto. Tallerkenens diam. vil jeg tippe til 8 - 10 m.\r\nTid er vanskelig, jeg vil anslå 15 sek. før den begynte å bevege seg horisontalt mot vest. Fargeskalaen forandret seg og var nærmest bare gulgrønn. Samtidig som rotasjonen økte, øket den til sen meget rask horisontal bevegelse. Det virket som jeg kunne følge den anslagsvis 1000 - 1500 m. mot vest.\r\nSelv om den virket mindre jo større avstanden ble så ble den ikke gradvis borte, når jeg mistet den av syne, var det som om den slukket en lommelykt.\r\nJeg ble ikke redd eller engstelig, men jeg følte ubehag og kroppslig uro, liksom jeg ble iakttatt av noe ukjent. Har fremdeles etter 40 år den samme følelsen. Har heller aldri senere vært på dette stedet etter mørkets frembrudd, er ikke redd, men føler en ubehagelig spenning.	\N	\N	\N	false	true	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	true	false	false	\N	false	false	false	false	false	false	false	false	true	\N	false	false	false	false	false	false	false	false	false	false	false	\N	true	false	false	se beskr.	false	false	false	false	false	true	se beskr.	false	false	false	false	false	false	false	true	se beskr.	false	false	false	false	false	false	false	false	false	false	false	true	false	false	\N	false	true	false	\N	false	false	false	false	false	false	\N	\N	\N	9 m.	2	2	false	false	false	false	false	false	true	false	false	false	false	false	false	false	false	false	false	false	fra venstre mot høyre	true	false	false	false	\N	true	false	false	false	false	false	false	false	false	false	false	false	false	false	2	0	1	\N	\N	false	false	\N	nei	2	1	true	false	false	false	false	false	false	false	false	false	\N	\N	false	\N	2	\N	true	true	\N	1	\N	false	false	false	false	false	false	false	false	false	\N	true	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	\N	4	måneskinn	ikke oppe	7	\N	5	\N	\N	En gjenstand.	2	\N	\N	false	\N	false	1	19.00	\N	14	1	\N	\N
