1295	00	09	1966	00091966-01	Svartnes Fergestad	4	\N	En dag i september kl. 16.00 1966 kjørte jeg med min bil Svartnes fergested for å vente på fergen.\r\nVed fergestedet sto to menn i mørkeblå kapper med belte. Der sto også en rød bil som jeg trodde var av ny type. Den var like ens både foran og bak, med to like lykter foran og bak. Hele bilen var avrundet helt, jeg så ikke noe hjul.\r\nJeg kjørte forbi ned på fergekaien. Da kom også de før nevnte personer mot meg. De var høye, mørke, solbrune med mørke briller. Det var brillene som jeg først var forundret over at de bar da det ikke var sol, men det var begynt å mørkne.\r\nJeg fikk da en angst-følelse, jeg føler at det er i forbindelse med de to menn. Jeg snur meg for å se etter fergen, da den ene sier: "ikke vær redd, vi skal ikke gjøre deg noe."\r\nDa jeg snur meg, står de 3-4 m. fra meg. Jeg blir forundret for de sa det ikke med lyd men med tankeoverføring.\r\nDa jeg så dem på nært hold, tenkte jeg at de ikke kunne være norske, men fra et annet land.\r\nDen ene snudde seg slik at jeg fikk se hans venstre øye, bak de før nevnte briller. Han hadde gul/grønne øyner, muligens refleks fra brilleglass. Jeg fikk se at den andre også hadde gule øyner.\r\nDeres øyner var store, avlange og lignet på dyreøyne.\r\nDa skjønte jeg at de måtte være fra en annen klode for deres hender hadde 6 fingre.\r\nSamtalen med dem begynte slik: Han: Du vet hvem vi er, men du skal glemme at du har møtt oss. Jeg sa: jeg vil ikke glemme dere, om jeg forteller noen om dere, vil ingen tro meg.\r\nJeg spurte: Er dere nylig kommet hit til vår klode, eller har dere vært her før. Han sa: Vi har ikke vært her før, men har hørt om dere fra andre som har vært her.\r\nJeg: Er det noe bestemt dere skal gjøre her. Han: Ja, forskning.\r\nJeg: Hva har gjort større inntrykk på dere?\r\nHan: De rare tingene dere har, (han pekte på bilen min) med det der som går rundt, (han pekte på hjulet.)\r\nJeg sa: Vi er ikke kommet lenger med å finne på noe bedre, kan dere skaffe meg noe som er bedre som dere har?\r\nHan: Ja det går nok godt an å bruke dem her. Han spurte også om hvordan man styrte bilen og hvilken drivkraft den hadde.\r\nHan: Hva slags striper er det som går i forskjellige retninger. Det vistes slik for oss da vi kom at det var uttørrede elver (han pekte på veien) hvorfor er den der?\r\nJeg sa: Det er veien vi må ha for å kjøre på med våre biler.\r\nHan: Er den laget av dere og fikk se noen menn som arbeidet på veien. Hvorfor slutter veien her og ikke fortsetter videre over vannet?\r\nJeg: Vi har en ferge som frakter bilene over og viste dem fergen som kommer over.\r\nJeg ser at det er kaldt for dem så jeg sier: Dere er vel vant til bedre vær enn det vi har.\r\nHan: Ja, du kan bli med oss dit.\r\nJeg: Ja, hvis turen ikke varer mer enn noen dager.\r\nHan: Det tar lenger enn noen dager å komme dit.\r\nJeg: Da kan jeg ikke være med dere. Jeg var redd at de skulle ta meg med makt, så jeg sa at jeg måtte hjem først for å ordne meg og si fra at jeg skulle reise med dem, men det fikk jeg ikke lov til. Jeg sa: Da reiser jeg ikke med dere.\r\nHan spurte meg om jeg var frisk for det skal være så mange syke her. Jeg sa at jeg syntes ikke det og at vi hadde dyktige leger her. Jeg for min del var frisk.\r\nHan sa at jeg var brukbar til deres forskning og at jeg måtte bli med dem.\r\nJeg sa: nei, nei, jeg passer ikke så bra, men dere finner sikkert andre.\r\nHan sa: Dere lever farlig her.\r\nJeg sa: Dere tenker vel på krigen vi har på vår klode, hvor menneskene dreper hverandre.\r\nHan: Hvorfor gjør dere det mot hverandre?\r\nJeg sa: Det har mange årsaker, vår klode er delt i flere land. Hvert land har en hersker (leder) som styrer. Enten er lederne utilfreds med det de har og forsøker å ta land fra en annen. Eller en del av menneskene i sitt land ikke er tilfredse med sitt styre så de går til krig.\r\nJeg sa videre: Dere har vel også noen som er herskere eller ledere på deres klode?\r\nHan så spørrende på den andre og sa: Vi har ikke noe sånt, det er nok noen som er ledere, men ikke slik som dere har det. Jeg spurte om de hadde vært der det er noe krig.\r\nHan: Nei, vi har ikke vært der ennå, men har hørt om den.\r\nJeg hadde ikke noen planmessig samtale med dem. Jeg var så urolig og ventet bare på at fergen skulle komme. Det merket han som var leder for vår samtale (via tankeoverføring.) Så han sa: Du er så urolig, jeg har sagt deg før at du ikke skal være redd, vi skal ikke gjøre deg noe.\r\nJeg sa: Det er den uvante måten vi fører samtale på, jeg er ikke vant til det. Dere kan vel snakke med hverandre med lyd slik jeg gjør det?\r\nHan sa: Ja, men det vil du ikke forstå noe av.\r\nJeg begynte å spørre om hva ting betydde på deres språk. Jeg forsto at de hadde det samme alfabet som vi, men ikke i samme rekkefølge. De hadde et lett og nydelig språk.\r\nFergen kom nå, og jeg sa til dem at de måtte komme igjen og hente meg hvis det ble krig i vårt land, eller før jeg ble for gammel til at de kjente meg igjen.\r\nHan: Vi vil nok kjenne deg igjen, vi har hørt at dere blir snart gamle og syke her.\r\nJeg så deres hoved-ufo ca. 2 km. fra der jeg sto, den var for det meste skjult av en bakke. Men jeg takserte den til ca. 200 m.  lang. men om den var avlang eller rund kunne jeg ikke se.	\N	\N	\N	false	false	false	false	false	true	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	true	rød, metallisk	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	true	false	false	\N	false	true	false	\N	false	false	false	false	false	false	\N	\N	\N	200	2	2	false	false	false	false	false	false	true	false	false	false	false	false	false	false	false	true	false	false	\N	false	false	false	false	\N	false	false	false	false	true	fals