1509	04	02	1994	04021994-01	8316 Laupstad	9	L. N. Solhaug	Opplevelsen var ikke stor, den varte bare i noen sekunder. Jeg så ut av vinduet mot nord, da et gult fenomen kom i lufta fra sør, mellom  mitt hus og naboen til høyre. Fenomenet hadde hode og hale. Halen var sammenhengende med hodet - smal innerst og blei bredere og bredere. Hodet hadde en glassaktig kjerne som skilte seg ut fra fargen ellers. Den gjorde en bue ned mot havet og alt sloknet samtidig.\r\nDen var veldig lang, men jeg så ikke slutten på halen fordi et utbygg står i veien. Jeg gikk ut på veien for å se om det var folk som hadde sent opp en rakett, men jeg verken så eller hørte noe. Dessuten har jeg aldri sett en slik rakett før.\r\nJeg tror det var noe som lignet et stjerneskudd. det kunne ikke vært så veldig høyt oppe etter buen å bedømme. Men jeg forstår meg lite på slikt. Synes observasjonen var bagatellmessig å regne og hadde ikke tenkt å melde fra om den - men jeg ble oppfordret og fikk tilsendt skjema - så da så.	\N	\N	\N	true	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	true	false	false	false	\N	false	false	false	false	false	false	false	false	true	gult	true	false	false	false	false	false	false	false	false	false	false	ult	false	true	false	\N	false	false	false	false	false	false	\N	true	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	true	false	\N	false	false	false	\N	false	false	false	false	false	false	\N	15	1	\N	1	2	false	false	false	false	true	false	false	false	false	false	false	false	false	false	false	false	false	true	\N	false	false	false	false	\N	false	false	false	false	true	false	false	false	false	false	false	false	false	false	2	1	2	\N	\N	false	false	Sluknet, muligens i hav, eller før.	\N	0	2	false	true	false	false	false	false	false	false	false	false	\N	\N	false	\N	2	\N	false	false	\N	1	\N	false	false	false	true	false	false	false	false	false	\N	true	false	false	