1526	00	04	1994	00041994-01	3110 Tønsberg	24	O-G. Røed	Jeg gikk, etter endt Tv-kveld ut på verandaen for å ta en røyk. Klokken var ca. 01.50 midt i uken i slutten av april. Det var stjerneklart, men over fjorden hang et tynt dislag.\r\nMine tanker var et halt annet sted enn himmel-legemet, da jeg i høyre synsfelt observerte noen kraftige lys. Først trodde jeg det var et slags fyrverkeri jeg så, men ble raskt klar over at jeg var vitne til noe helt annet. Den neste tanke var at det kanskje var masten på et skip jeg så, men jeg måtte avfeie denne teorien grunnet både hastigheten og høyden på observasjonen. Jeg har vanskelig for å begrunne at det var fly jeg så, ettersom jeg kunne høre noen flydur eller at lysene blinket.\r\n\r\nJeg observerte formasjon av konstant lys. Deres orange lys kan muligens forklares av dislagets refleksjon av gatelysene. De fulgte Tønsbergkanalens løp fra nordvest til sørøst. Da de antagelig hadde kommet over fjorden ved Foynland/Husø, krenget hele formasjonen i en mer sydlig retning hvor det så ut som de samtidig steg. Lysene ble svakere grunnet disen. (Etter at formasjonen var ute av syne hørte jeg et fjernt drønn, men dette kan selvsagt ha vært lyden av industri eller for den saks skyld Bolærne militærforlegning som ligger i samme retning.) Foruten lysene kunne jeg også observere et meget svakt sus/visling. Hastigheten må ha vært stor for jeg opplevde samme effekten som om en bil kjører i stor hastighet forbi; først er det vanskelig å feste blikket, men ettersom den kommer på avstand blir det lettere å følge den.\r\n\r\nJeg skjønte raskt at jeg observerte noe som vanskelig lot seg forklare. om lysene kom fra en gjenstand eller at de kom fra forskjellige gjenstander som fløy i formasjon kan jeg ikke gi svar på grunnet disen og den korte tiden jeg så dette. Derimot fikk jeg følelsen av en gjenstand da den krenget sørover. I så tilfelle må den ha vært enormt stor.	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	fals