1538	00	\N	1994	Høst-94	8960 Hommelstø	26	O-G. Røed	Dette fenomenet skjedde på Sør-Helgeland høsten 1994 da jeg hadde kjøpt et småbruk. Eiendommen ligger litt for seg selv og har ingen utebelysning. Den er et nærmest firkantet areal på 30 mål. Utover høsten begynte det å "lyne" i det ene området av eiendommen. Lynene lå like over bakken og rakte ca. 25 m. opp i luften. De var blå av farge og sterke/klare som man ser i elektrisk støt. De hadde ingen sammenheng med været eller tid på døgnet. Av og til kom de hver kveld og andre ganger i et glimt med en ukes mellomrom. De lyste godt opp og vi kunne også merke dem når vi var inne. De kunne ikke sammenlignes med værglimt, kulelyn eller vanlig lyn.\r\nEtterhvert flyttet lynet seg videre, hele tiden i ytterkant av eiendommen min. De ble etterhvert større, klarere og sterke på farge, og hadde til slutt (etter 5. mnd.) omkranset eiendommen. I løpet av de første mnd. fikk jeg en sterk følelse at det dreide seg om en utrensing av jordsmonnet uten å kunne forklare hvorfor. Det hele endte i feb.-95 med et enormt stort, ca. 300 m. langt og 30 m. høyt, skarpt blått lyn som ble stående å vibrere og blinke slik at området ble badet i blått lys og hele opplevelsen pågikk i ca. 15 min.\r\nVi var 3 voksne som så dette fenomenet. Natten var stjerneklar og vindstille så opplevelsen var ekstra vakker.\r\nNoen dager senere ca. kl. 23.00 var området igjen kraftig opplyst, denne gangen av et sterkt hvitt lys. Da jeg kikket ut av vinduet for å finne ut hva lyset kom fra, hang der en ufo 100 m. fra huset. Den sendte en lyssøyle ned på marka og derfra husker jeg ingenting.\r\nUfoen var på størrelse med månen og viste seg bare som meget sterkt hvitt lys.	\N	\N	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	false	false	\N	fa