1540	10	09	1994	10091994-01	2480 Koppang	5	\N	Klokken 21.45 så vi først et rødt, grønt, blålig og hvitt flygende objekt på himmelen. Vi så på det i 10 min. da det flyttet seg med en utrolig fart lenger ned på himmelen. Der ble det stående i ca. 40 min. før det sakte begynte å forsvinne, plutselig ble det helt borte. Vi fulgte hele tiden fenomenet med en vanlig kikkert (8x50).\r\nEtter at det hadde gått ca. 10 min. bestemte vi oss for å kjøre innover Vinjevegen for å se om vi fikk øye på fenomenet igjen. Da vi hadde kjørt ca. 2 km vestover mot Ringebu kommune var vi over tregrensa og fikk se fenomenet igjen, denne gangen i nordvestlig himmelretning. Vi stoppet bilen og bestemte oss for å signalisere til "det" med fulltlyset på bilen for å se om vi hadde noen kontakt, det skjedde ingenting og vi kjørte østover mot hytta igjen. (Vinjevegen er et hytteområde rett ovenfor Koppang) Da vi hadde kommet et lite stykke bestemte vi oss for  å prøve å signalisere igjen. Vi blinket med lysene to ganger og gikk ut av bilen for å se litt i kikkerten. Min tante hadde kikkerten først og sa til meg at lysene kom nærmere. Jeg løp over på førersiden av bilen hvor hun sto og tok kikkerten for å se. Jeg fikk et støkk i meg da jeg så et hvitt lys som dekket hele kikkertsiktet. Tante hadde allerede satt seg inn i bilen og jeg hoppet også inn uten å se meg tilbake og vi kjørte fort nedover mot hytta igjen. Vi hørte ingen lyd fra fenomenet og vi så heller ikke noe mer etter dette.	\N	\N	\N	false	false	false	false	false	true	false	false	false	false	false	false	false	false	false	false	false	false	\N	true	false	false	false	\N	false	false	false	false	false	false	false	false	true	se beskr.	false	false	false	false	false	false	false	false	false	false	false	\N	true	false	false	grønt til blått	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	true	se beskr.	false	false	false	false	false	false	false	false	false	false	false	true	false	false	\N	false	true	false	\N	false	fa