1610	11	08	1995	11081995-01	Leksvik	8	\N	Min kone og jeg var tirsdag 11-8-95 på tur inn Trondheimsfjorden i båt. Vi hadde passert Leksvik da det ble kuling fra Nordøst og mye sjøsprøyt så kona gikk inn i kahytta, mens jeg stod til rors i ly for denne. Klokken var 20.00 og vi hadde solen bak oss. Da ble jeg merksom på en metallisk gjenstand som reflekterte sol lyset som et speil. Himlen var uten skyer, kun et tynt slør. Gjenstanden så jeg under dette sløret. Størrelsen av gjenstanden var ca. 1/4 av lengden.\r\nGjenstanden hadde kurs mot NØ, men gled så unaturlig lett sidelengs ut til høyre før den igjen tok opp NØ kursen. Jeg måtte passe båten og når jeg igjen så opp var den borte. Men etter en kort tid var den på samme sted igjen og med samme kurs som jeg så den første gang, men nå merket jeg ikke noen kursendring. Jeg ble så nyskjerrig og tenkte å følge med litt bedre, men da jeg så opp var den atter borte. Siden så jeg den ikke mer.	\N	\N	\N	false	false	false	false	false	false	true	false	false	false	false	false	false	false	false	false	false	false	\N	false	true	false	false	\N	false	false	false	false	false	false	true	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	\N	false	true	false	\N	false	false	false	false	false	false	\N	true	false	false	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	true	false	false	false	\N	false	false	false	\N	false	true	false	false	false	false	\N	0.2 cm	3	\N	2	2	false	true	false	false	false	false	false	false	false	false	true	false	false	false	false	false	false	false	Fra høyre mot venstre	false	true	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	1	1	2	\N	Vet ikke	false	false	\N	\N	0	1	true	false	false	false	false	false	false	false	false	false	\N	\N	false	\N	2	\N	false	false	\N	1	\N	false	false	false	false	false	false	false	false	false	\N	false	false	true	false	false	false	\N	false	false	false	false	false	false	fal