1612	18	08	1995	18081995	Sendsjøen	5	\N	Idet båten driver nedover elva, gjør Geir meg oppmerksom på  et skarpt lys han ser kommer tilsyne over fjellet. Jeg snur meg og ser også dette. Det var veldig skarpt og klart med en gang han så det sa han etterpå, Da jeg fikk øye på lyset var det imidlertid mer "ullent" og uklart i formene. Vi anslår avstanden til kanskje en kilometer høyt oppe og ca. en kilometer sør for oss. Lyset går horisontalt ut fra fjellet og utover dalen. Midt over dalen/elva blir det imidlertid mer og mer "uklart" og etter noen sekunder er det søkk borte. Himmelen var fortsatt helt skyfri. Størrelsen var vel omtrent som en kvart fullmåne. Vi kunne tydelig se en slags oval form med tendenser til "kanter". Se for øvrig tegning. Vi så vel lyset i kanskje 15 sekunder før den ble borte. Fly var det garantert ikke, vi hadde sett fly tidligere på kvelden. Det var heller ingen satellitt, da den gikk ganske lavt og var mye større. Farven var vel ganske gulaktig, og etter hvert ble den som sagt, mer tåkete i kantene før den etter hvert forsvant. Geir sa etterpå at den var helt klar, nærmest metallisk idet han så den først. Området den kom ifra er et fjell-området, ubebodd, kanskje med unntak av en del hytter spredt rundt i området.\r\nVi kunne heller ikke oppfatte noen slags lyd fra objektet. Jeg hadde videokamera tilgjengelig, og gjorde forsøk på å filme det vi så. Imidlertid var kameraet slått av da vi fikk se lyset, og det tar ca. 10 sekunder bare å klargjøre kameraet til opptak + oppakking fra bag, så da jeg endelig hadde fått kameraet hadde lyset blitt borte, dessverre.\r\nDette var første gangen jeg så UFO.\r\n\r\n     \r\n       Notat:\r\n             \r\n               Informasjon om hendelsen var levert på eget ark, og ikke etter Rapport Skjema som er standard.\r\n               Derfor er informasjonen veldig ukalre noen steder, og ikke tilgjengelig i det hele tatt andre steder.\r\n              \r\n               Flere observasjoner er blitt gitt, se 