e\r\nvar slukket. Først når vi var langt forbi Rygge flystasjon ble det normal lyd på bilen og lys på veien igjen.\r\nGatelyktene fungerte. Jeg ble skremt da jeg oppdaget at klokken var 03.30. Helga også. Jeg er 100% sikker\r\nat jeg var hjemme kl.03.30. De andre påstår det samme. Men alle klokkene og min egen hjemme var 03.30.\r\nJeg var ikke "hysterisk" redd, som Bente påstod. Var mer opprømt. Men tanken på å bli tatt opp - ville skremt\r\nvettet av meg. Men noe må åpenbart ha skjedd.\r\nEtter disse møtene har jeg hatt helt spesielle drømmer - helt spesielle beskjeder. Jeg får beskjed\r\nom plutselig sette meg ned å skrive - da de har noe å fortelle meg.  Når det gjelder andre uforklarlige \r\nhendelser - kan jeg bare nikke bekreftende. Sender kopi av beskjeder jeg er blitt bedt om.	\N	\N	\N	false	false	false	false	false	true	false	false	false	false	false	false	false	false	false	false	false	false	\N	true	false	false	false	\N	false	false	false	false	false	false	true	false	false	\N	true	false	false	false	false	false	false	false	false	false	false	Hvitt lys	false	true	false	\N	true	false	false	false	false	false	Flylys	true	false	false	false	false	false	false	false	\N	false	false	false	false	true	false	false	false	false	false	false	false	false	false	Svak/brummende	true	false	false	Sus i bilen	true	false	false	false	false	false	Fly på avstand	30	\N	\N	2	2	false	true	false	false	false	false	false	false	false	false	false	false	false	false	true	true	false	false	\N	false	false	false	false	\N	false	false	false	false	false	false	false	false	false	false	false	false	false	false	1	1	1	\N	30-50cm	false	false	Se tegning ved rapport.	\N	0	3	false	false	true	false	false	false	false	false	false	false	\N	\N	false	\N	1	Fjernlys i bil, fysisk kraftløs	false	false	\N	1	Spesielt lys	false	false	false	true	true	false	false	false	false	Stjerneklart	true	false	false	false	false	false	\N	false	false	false	false	false	false	false	false	\N	3	\N	Annet	9	\N	7	\N	\N	Overbevist at det var to UFO'er